11384=>["Value"=>11384,"TextKey"=>"图鉴描述10501","TextValue"=>"The King of the Hill Kingdom. A total sweet tooth. He's loved by the people for being happy-go-lucky, amiable and charismatic."],
11385=>["Value"=>11385,"TextKey"=>"图鉴描述10502","TextValue"=>"Allgemein bekannt als einer der größten Zauberer seiner Zeit. Mit fruchtbarem Genie, Wohlwollen, Liebenswürdigkeit und Einsicht versehen. Von allen Verkleidungen verwandelte er sich meist in ein Kaninchen, und nur wenige haben sein wahres Gesicht hinter dem Zauber gesehen."],
11386=>["Value"=>11386,"TextKey"=>"图鉴描述10503","TextValue"=>"Der legendäre Geschichtenerzähler und Musikkomponist des Stammes. Als er durch die Länder und Meere streifte, sah ihn nie jemand. Mit seiner tiefen Stimme und seinem Verstand wurden viele Lobeshymnen gesungen. "],
11387=>["Value"=>11387,"TextKey"=>"图鉴描述10504","TextValue"=>"Rein und Peng. Sie ist neugierig auf die Außenwelt und spielt gerne Schlagzeug, wenn sie sich ausdrucksstark fühlt."],
11388=>["Value"=>11388,"TextKey"=>"图鉴描述10505","TextValue"=>"Der König aller Löwen und geht wie ein Mensch. Einst verlor sie mit ihren Stammesmitgliedern ihr wunderbares Heimatland, mit ihrer außergewöhnlichen Stärke, ihrem Zeugnis und ihrer Tapferkeit wird jedoch ein wahrer Führer es endlich zurückerobern."],
11389=>["Value"=>11389,"TextKey"=>"图鉴描述10506","TextValue"=>"Walked out of a heartbreaking past, she becomes stronger and more optimistic. She also learnt a magic that can makes visions in match flames come true."],
11390=>["Value"=>11390,"TextKey"=>"图鉴描述10507","TextValue"=>"He's wee stingy and naughty. Was once cursed by the Witch because of his prank. With a pumpkin head, he becomes more kind, often holding a lantern to light passers-by in the dark."],
