12681=>["Value"=>12681,"TextKey"=>"新手引导说明1012","TextValue"=>"<line-height=130%><color=#38aec0>Heimatland</color> ist freigeschalten! Schau gleich einmal nach!"],
12682=>["Value"=>12682,"TextKey"=>"新手引导说明2000","TextValue"=>"<line-height=130%>Gutmütiger Mensch dort drüben, hilf mir bitte!"],
12683=>["Value"=>12683,"TextKey"=>"新手引导说明2001","TextValue"=>"<line-height=130%>Ich stecke in diesen <color=#38c0a5>Totems</color>fest!"],
12684=>["Value"=>12684,"TextKey"=>"新手引导说明2002","TextValue"=>"Kombiniere beliebige 3<color=#38c0a5> Totems</color> der gleichen Art zusammen, um eine <color=#f58c26>Kombination</color> auszulösen. Der Flucht wird dadurch aufgehoben."],
12685=>["Value"=>12685,"TextKey"=>"新手引导说明2010","TextValue"=>"<line-height=130%> Oh nein! Ich sehe überhaupt keine Totems hier!"],
12686=>["Value"=>12686,"TextKey"=>"新手引导说明2011","TextValue"=>"<line-height=130%> Schau mal! Das ist der <color=#f58c26>Code der Erschaffung</color>. Du wirst ihm in vielen Leveln noch begegnen. Lass uns nachsehen, was darauf geschrieben ist."],
12687=>["Value"=>12687,"TextKey"=>"新手引导说明2012","TextValue"=>"<line-height=130%>Tippe darauf, um einige hilfreiche Tipps für das Spiel zu erhalten. Versuch‘s mal!"],
12688=>["Value"=>12688,"TextKey"=>"新手引导说明2020","TextValue"=>"<line-height=130%> Wenn du das Level schaffen möchtest, brauchst du ein<color=#f58c26>Bestimmtes Objekt</color>."],
12689=>["Value"=>12689,"TextKey"=>"新手引导说明2022","TextValue"=>"<line-height=130%>Das <color=#f58c26>Ziel des Levels</color>wird dir sagen, was zu tun ist. Fange an zu kombinieren und gewinne!"],
12690=>["Value"=>12690,"TextKey"=>"新手引导说明2030","TextValue"=>"<line-height=120%>Wow! Eine<color=#ef933d>Schnitzerei der Jungen Embla</color>! Ihre Kräfte sind auch verblasst! Wir müssen <color=#f58c26>Embla</color>erwecken, indem wir die Schnitzereien kombinieren."],
12691=>["Value"=>12691,"TextKey"=>"新手引导说明2031","TextValue"=>"Wenn ein Level diese Schnitzereien hat, kannst du das Level in der Regel durch kombinieren der Schnitzereien schaffen."],
12692=>["Value"=>12692,"TextKey"=>"新手引导说明2032","TextValue"=>"<line-height=130%>Diese Land haben den Glauben an ihre Göttin verloren, und sind deswegen in einen tiefen Schlaf gefallen."],
12693=>["Value"=>12693,"TextKey"=>"新手引导说明2033","TextValue"=>"<line-height=130%>Du kannst auf<color=#38aec0>Inaktives Land</color> keine Objekte bewegen."],
12694=>["Value"=>12694,"TextKey"=>"新手引导说明2034","TextValue"=>"<line-height=130%>Kombiniere beliebige<color=#38c0a5>Geisterblumen</color>, um das Land zu erwecken."],
12695=>["Value"=>12695,"TextKey"=>"新手引导说明2035","TextValue"=>"<line-height=130%>Wenn du gewinnst, wird die<color=#f58c26>Göttin Embla</color> das Land aufwecken!"],
12696=>["Value"=>12696,"TextKey"=>"新手引导说明2040","TextValue"=>"<line-height=130%>Schau! Es ist ein<color=#38c0a5>Totem</color>."],
12697=>["Value"=>12697,"TextKey"=>"新手引导说明2041","TextValue"=>"Beeil dich und kombiniere<color=#38c0a5>Drei Totems</color>, um die Stammesmitglieder zu retten, die dort drinnen gefangen sind."],
12698=>["Value"=>12698,"TextKey"=>"新手引导说明2050","TextValue"=>"Wie bereits erwähnt, du kannst durch antippen von <color=#38c0a5>Runenkugeln</color> das Land erwecken."],
12699=>["Value"=>12699,"TextKey"=>"新手引导说明2051","TextValue"=>"<line-height=130%>Natürlich kannst du sie auch kombinieren, um forgeschrittenere Items zu erhalten."],
12700=>["Value"=>12700,"TextKey"=>"新手引导说明2060","TextValue"=>"Du kannst Objekte auf <color=#38aec0>Inaktivem Land</color> mit Objekten auf normalen Land kombinieren, um das Inaktive Land automatisch zu erwecken."],
12701=>["Value"=>12701,"TextKey"=>"新手引导说明2070","TextValue"=>"Tippe auf eine<color=#38c0a5>Totemgruppe</color>, um ein <color=#38c0a5>Totem</color> zu erhalten."],
12702=>["Value"=>12702,"TextKey"=>"新手引导说明2080","TextValue"=>"Einige <color=#38aec0>Super Inaktive Land</color> können nicht durch <color=#f58c26>Heilpunkte</color>erweckt werden, sondern nur durch das Kombinieren mit Objekten vom normalen Land."],
12703=>["Value"=>12703,"TextKey"=>"新手引导说明2090","TextValue"=>"<line-height=130%>Ab hier kommen Level mit <color=#f58c26>Aufgaben</color>."],
12704=>["Value"=>12704,"TextKey"=>"新手引导说明2091","TextValue"=>"<line-height=130%>Du kannst die <color=#38c0a5>Aufgabensonne</color>für Aufgaben und Belohnungen überprüfen."],
12705=>["Value"=>12705,"TextKey"=>"新手引导说明2093","TextValue"=>"<line-height=130%>Dieser Knopf kann die <color=#f58c26>Funktion zum Schieben des Bildschirms</color> sperren und entsperren."],
12706=>["Value"=>12706,"TextKey"=>"新手引导说明2100","TextValue"=>"Manche Objekte können nicht direkt kombiniert werden. Tippe den <color=#ef933d>Stapel Keilförmige Steine</color> an, um ihn in<color=#ef933d>Keilförmige Steine</color> aufzuteilen, und dann zu kombinieren. "],
12707=>["Value"=>12707,"TextKey"=>"新手引导说明2110","TextValue"=>"<line-height=130%>Du musst die<color=#f58c26>Levelziele</color>überprüfen."],
12708=>["Value"=>12708,"TextKey"=>"新手引导说明2130","TextValue"=>"<line-height=130%>Du kannst <color=#ef933d>Buschsprossen</color> von <color=#38c0a5>Drachenknochen</color> erhalten."],
12709=>["Value"=>12709,"TextKey"=>"新手引导说明2140","TextValue"=>"Das ist eine große <color=#ef933d>Weck-Bombe</color>. Wenn du das Land daneben damit aufweckst, erwacht es automatisch und auch alle umliegenden Felder erwachen."],
12710=>["Value"=>12710,"TextKey"=>"新手引导说明2150","TextValue"=>"Stammesmitglieder können <color=#38c0a5>Wildes Erz</color> von<color=#38c0a5>Weinreben</color> eines höheren Levels für dich sammeln."],
12711=>["Value"=>12711,"TextKey"=>"新手引导说明2160","TextValue"=>"Das ist ein <color=#ef933d>Zerstörtes Grab</color>. Ignorierst oder kombinierst du sie, werden sie zu furchteinflößenden <color=#df66a8>Zombies</color>. Besiege sie, um <color=#38c0a5>Glühwürmchen</color> zu erhalten, die du brauchst, um das Level zu meistern."],
12712=>["Value"=>12712,"TextKey"=>"新手引导说明2170","TextValue"=>"Ein <color=#ef933d> Verlassenes Wandnest </color>generiert konstant Zombies, sogar ruhend. Beim Tippen darauf lässt dies einen Zombie sofort erscheinen! Wenn du die Zombies besiegt, gibt es dafür <color=#38c0a5>Wildes Erz</color>."],
12713=>["Value"=>12713,"TextKey"=>"新手引导说明2180","TextValue"=>"Das ist ein <color=#38c0a5>Druiden Runenportal</color>, was für ein Glück! Kombiniere sie, um <color=#38c0a5>Stammesmitglied</color> vom Heimatland zu beschwören, um dir zu helfen."],
12714=>["Value"=>12714,"TextKey"=>"新手引导说明2190","TextValue"=>"Ein Überbleibsel des heiligen Baumes der Schöpfung. Produziert automatisch <color=#38c0a5>Runenkugeln</color>. Je höher das Level, desto stärker sind seine Heilkräfte."],
12715=>["Value"=>12715,"TextKey"=>"新手引导说明2200","TextValue"=>" <color=#ef933d>Wolken</color> werden ab jetzt erscheinen. Tippe sie an, um es regnen zu lassen. <color=#38c0a5>Regenpfützen</color> und <color=#38c0a5>Geisterblumen</color> werden auf dem freien Land darunter erscheinen."],
12716=>["Value"=>12716,"TextKey"=>"新手引导说明2210","TextValue"=>"<line-height=130%> Seltsam...Wo sind denn nur die <color=#ef933d>Schnitzereien der Jungen Embla</color> hin?"],
12717=>["Value"=>12717,"TextKey"=>"新手引导说明2211","TextValue"=>"<line-height=130%> Ach, stimmt ja. Wenn du deine <color=#f58c26>Aufgaben</color> erledigt hast, erscheinen sie!"],
12718=>["Value"=>12718,"TextKey"=>"新手引导说明2220","TextValue"=>"Das ist eine <color=#ef933d> Statue des Dämons</color>. Ein gar abscheuliches Stück! Befehle deinen Leuten es zu vernichten, um <color=#ef933d> Schnitzerei der jungen Embla</color> zu erhalten."],
12719=>["Value"=>12719,"TextKey"=>"新手引导说明2230","TextValue"=>"<line-height=130%> Ein neues Lager ist verfügbar! Siehe auf der Weltkarte mal nach!"],
12720=>["Value"=>12720,"TextKey"=>"新手引导说明2240","TextValue"=>"<line-height=130%> Ich bin wieder frei! Vielen Dank! "],
12721=>["Value"=>12721,"TextKey"=>"新手引导说明2241","TextValue"=>"<line-height=130%> Deine Stammesleute sind in diesen <color=#38c0a5>Totems</color> gefangen."],
12722=>["Value"=>12722,"TextKey"=>"新手引导说明2242","TextValue"=>"<line-height=130%> Dein Stamm braucht deine Hilfe, um die anderen Stammesmitglieder hier und auch zuhause wieder zu finden."],
12723=>["Value"=>12723,"TextKey"=>"新手引导说明2243","TextValue"=>"<line-height=130%> Gehe im nächsten Level auf die Suche nach ihnen!"],
12724=>["Value"=>12724,"TextKey"=>"新手引导说明2250","TextValue"=>"Mit doppeltem<color=#f58c26>Antippen</color> kannst du einige Objekte dazu bringen, jemanden für die Ernte herbeizurufen."],
12725=>["Value"=>12725,"TextKey"=>"新手引导说明2251","TextValue"=>"<line-height=130%> Du kannst die Objekte, die du gesammelt hast benutzen, oder sie kombinieren."],
12726=>["Value"=>12726,"TextKey"=>"新手引导说明2252","TextValue"=>"<line-height=130%> Ernte von einer <color=#38c0a5>Geisterblume</color>, um <color=#38c0a5>Runenkugel</color> zu erhalten."],
12727=>["Value"=>12727,"TextKey"=>"新手引导说明2253","TextValue"=>"<color=#f58c26>Tippe die Kugel an</color>, um <color=#38aec0>Superinaktives Land</color> zu erwecken."],
12728=>["Value"=>12728,"TextKey"=>"新手引导说明2261","TextValue"=>"<line-height=130%>Ab jetzt kannst du Belohnungen am Ende jedes Levels auswählen."],
12729=>["Value"=>12729,"TextKey"=>"新手引导说明2262","TextValue"=>"<line-height=130%>Belohnungen sind normalerweise<color=#38c0a5>Gold</color> oder andere nützliche Rohstoffe. Manchmal sogar ein Totem!"],
12730=>["Value"=>12730,"TextKey"=>"新手引导说明2263","TextValue"=>"<line-height=130%>Deine Belohnung werden in <color=#f58c26>Blasen</color>gepackt und nach Hause gesendet."],
12731=>["Value"=>12731,"TextKey"=>"新手引导说明3000","TextValue"=>"<line-height=130%>Das ist unser <color=#f58c26>Heimatland</color>."],
12732=>["Value"=>12732,"TextKey"=>"新手引导说明3001","TextValue"=>"<line-height=130%>Hier haben wir einst unser Zuhause nennen können, bevor die <color=#f58c26>Große Flut</color> unser friedliches Leben zerstörte. Alles was zurückblieb, ist ein dichter Nebel, der das Land einhüllt."],
12733=>["Value"=>12733,"TextKey"=>"新手引导说明3002","TextValue"=>"<line-height=105%>Kombiniere Objekte mit denen auf inaktiven Ländern, um das Land direkt zu erwecken! Versuche durch Kombinieren mehr Stammesmitglieder zu retten! Je größer die Bevölkerung ist, desto mehr Nebel kann sich lichten, und desto schneller kannst du unsere Heimat wieder aufbauen."],
12734=>["Value"=>12734,"TextKey"=>"新手引导说明3005","TextValue"=>"<line-height=130%>Du kannst nur eine <color=#38c0a5>Zeitschatztruhe</color> auf einmal freischalten. Warte bis zum Ende des Countdowns oder verwende Rubine, um <color=#38c0a5>Zeitschatzztuhen</color> sofort freizuschalten."],
12735=>["Value"=>12735,"TextKey"=>"新手引导说明3006","TextValue"=>"<line-height=130%>Levelbelohnungen sind da! Lasse die Luftblasen platzen und sieh nach deiner Belohnung!"],
12736=>["Value"=>12736,"TextKey"=>"新手引导说明3010","TextValue"=>"<line-height=130%><color=#38c0a5>Langhäuser</color> sind Orte, an denen deine Arbeiter sich ausruhen können. Nach einiger Zeit kommen sie wieder heraus."],
12737=>["Value"=>12737,"TextKey"=>"新手引导说明3011","TextValue"=>"<line-height=130%><color=#38c0a5>Langhäuser</color> können zu höheren Leveln kombiniert werden. Je höher das Level, desto kürzer brauchen die Stammesmitglieder, um sich auszuruhen."],
12738=>["Value"=>12738,"TextKey"=>"新手引导说明3016","TextValue"=>"<line-height=130%>Verwende <color=#38c0a5>Rubine</color>, um sie sofort zu wecken."],
12739=>["Value"=>12739,"TextKey"=>"新手引导说明3030","TextValue"=>"Du kannst mehr Aufgaben auf dem Heimatland erledigen, um mehr <color=#38c0a5>Vergessenes Erbe</color> zu erhalten. Tippe darauf, um spezielle Belohnungen zu erhalten."],
12740=>["Value"=>12740,"TextKey"=>"新手引导说明3040","TextValue"=>"<line-height=130%>Dies ist ein kleines Stück <color=#38c0a5>Gold</color>."],
12741=>["Value"=>12741,"TextKey"=>"新手引导说明3041","TextValue"=>"<line-height=120%>Du kannst es antippen, um etwas <color=#38c0a5>Gold</color> zu erhalten, oder du kannst sie zu fortgeschritteneren Goldnuggets kombinieren."],
12742=>["Value"=>12742,"TextKey"=>"新手引导说明3042","TextValue"=>"<line-height=130%>Dein <color=#38c0a5>Gold</color> kannst du im <color=#f58c26>Shop</color> ausgeben."],
12743=>["Value"=>12743,"TextKey"=>"新手引导说明3050","TextValue"=>"<line-height=130%>Zu viel Gold? Dann kannst du dir im Shop ein paar richtig gute Sachen kaufen!"],
12744=>["Value"=>12744,"TextKey"=>"新手引导说明3060","TextValue"=>"<line-height=130%>Alle <color=#df66a8>Stammesmitglieder</color>sind zu erschöpft. Sie brauchen eine Pause, um ihre Energie wieder herzustellen."],
12745=>["Value"=>12745,"TextKey"=>"新手引导说明3061","TextValue"=>"<line-height=130%>Es wird Zeit mehr Level zu schaffen und Leute zu retten!"],
12746=>["Value"=>12746,"TextKey"=>"新手引导说明3062","TextValue"=>"<line-height=120%>Je mehr Stammesmitglieder du hast, desto mehr Rohstoffe können sie für dich sammeln, bevor sie sich schlafen legen."],
12747=>["Value"=>12747,"TextKey"=>"新手引导说明3063","TextValue"=>"<line-height=130%>Erledige die Level, um mehr Stammesmitglieder zu retten."],
12748=>["Value"=>12748,"TextKey"=>"新手引导说明3064","TextValue"=>"<line-height=130%>Bringe alle sicher nach Hause!"],
12749=>["Value"=>12749,"TextKey"=>"新手引导说明3065","TextValue"=>"<line-height=130%>Schau mal! Du kommst durch Antippen der <color=#f58c26>Weltkarte</color>zum Lager."],
12750=>["Value"=>12750,"TextKey"=>"新手引导说明3070","TextValue"=>"<line-height=130%>Es gibt keinen weiteren Platz, der Boden ist vollständig bedeckt!"],
12751=>["Value"=>12751,"TextKey"=>"新手引导说明3071","TextValue"=>"<line-height=130%>Wähle ein Objekt aus, und wähle in der Infobox, ob du es verkaufen oder verwerfen willst. "],
12752=>["Value"=>12752,"TextKey"=>"新手引导说明3080","TextValue"=>"Das ist ein <color=#38c0a5>Fremdes Erbe</color>, es ist extrem selten! Tippe darauf, um <color=#38c0a5>Rubinen</color>zu erhalten! Oder du kannst sie zu erweiterten Rubinen kombinieren."],
12753=>["Value"=>12753,"TextKey"=>"新手引导说明3090","TextValue"=>"<line-height=130%>Das ist ein Stück <color=#38c0a5>Wildes Erz</color>."],
12754=>["Value"=>12754,"TextKey"=>"新手引导说明3091","TextValue"=>"<line-height=130%>Du kannst sie antippen, um <color=#38c0a5>Wildes Erz</color> zu sammeln, oder du kannst sie zu erweiterten Erzen kombinieren."],
12755=>["Value"=>12755,"TextKey"=>"新手引导说明3092","TextValue"=>"<line-height=130%>Du kannst das eingesammelte <color=#38c0a5>Wilde Erz</color> <color=#f58c26>im Shop</color> verwenden."],
12756=>["Value"=>12756,"TextKey"=>"新手引导说明3100","TextValue"=>"<line-height=130%>Wenn dein<color=#38c0a5>Wilder Erz</color> Vorrat zu voll wird, kannst du es im Shop benutzen."],
12757=>["Value"=>12757,"TextKey"=>"新手引导说明3110","TextValue"=>"Diese <color=#38c0a5>Straßensperre</color>hier stört mich sehr! Aber du kannst sie nicht direkt bewegen. Befehle deine <color=#df66a8>Stammesmitglieder</color> hierher, sie können die Straßensperren in kleinere Teile zerlegen."],
12758=>["Value"=>12758,"TextKey"=>"新手引导说明3120","TextValue"=>"<color=#38c0a5>Geschützbanken</color>verunreinigen Böden auch im schlafenden Land. Der <color=#f58c26>Fortschrittsbalken</color>zeigt dir wie lange es zwischen den Schüssen braucht. Du kannst nur eine wache Geschützbanken attackieren."],
12759=>["Value"=>12759,"TextKey"=>"新手引导说明3130","TextValue"=>"Das ist ein <color=#f58c26>Heldenaltar</color>. Helden können zwischen <color=#f58c26>Ruhemodus</color> und <color=#f58c26>Patroullien-Modus</color> wechseln."],
12760=>["Value"=>12760,"TextKey"=>"新手引导说明3131","TextValue"=>"Mit einem Helden an deiner Seite, erhälst du zusätzliche Überraschungen für alle <color=#f58c26>4er Kombinationen</color>!"],
12761=>["Value"=>12761,"TextKey"=>"新手引导说明3132","TextValue"=>"Wenn sie im Ruhemodus sind, kannst du <color=#38c0a5>Rubinen</color> verwenden, um sie sofort aufzuwecken."],
12762=>["Value"=>12762,"TextKey"=>"新手引导说明3133","TextValue"=>"Du kannst hier antippenn, um Informationen zum Held anzusehen."],
12763=>["Value"=>12763,"TextKey"=>"新手引导说明3142","TextValue"=>"<line-height=130%> Helden haben als starke Einheiten des Stammes einzigartige Fähigkeiten."],
12764=>["Value"=>12764,"TextKey"=>"新手引导说明3144","TextValue"=>"<line-height=130%>Du kannst die Beschreibung der Heldenfähigkeiten hier in der <color=#f58c26>Heldenfähigkeiten-Box</color> überprüfen."],
12765=>["Value"=>12765,"TextKey"=>"新手引导说明3145","TextValue"=>"<line-height=130%>Du kannst die Helden aufleveln, indem du abgeschlossene <color=#f58c26>Quests</color>einreichst."],
12766=>["Value"=>12766,"TextKey"=>"新手引导说明3147","TextValue"=>"Beende alle Quests, um deinen Helden aufzuleveln!"],
12767=>["Value"=>12767,"TextKey"=>"新手引导说明3150","TextValue"=>"<line-height=130%>Gut gemacht! Weitere Stammesmitglieder haben sich von dem Siegel des Zauberers befreit!"],
12768=>["Value"=>12768,"TextKey"=>"新手引导说明3151","TextValue"=>"Mit mehr Mitgliedern in Ihrem Stamm, können Sie mehr <color=#f58c26>Nebel</color>lichten."],
12769=>["Value"=>12769,"TextKey"=>"新手引导说明3152","TextValue"=>"<line-height=130%>Der Nebel in jedem Gebiet erfordert ein bestimmtes Maß an Stammeskraft, um sich aufzulösen."],
12770=>["Value"=>12770,"TextKey"=>"新手引导说明3153","TextValue"=>"<line-height=130%>Jetzt können wir den Nebel in diesem Bereich lichten!"],
12771=>["Value"=>12771,"TextKey"=>"新手引导说明3161","TextValue"=>"Du kannst diesen Nebel noch nicht lichten."],
12772=>["Value"=>12772,"TextKey"=>"新手引导说明3162","TextValue"=>"<line-height=130%>Deine<color=#f58c26>Stammesmacht</color> ist nicht hoch genug. Du kannst weitere Totems im Shop kaufen."],
12773=>["Value"=>12773,"TextKey"=>"新手引导说明3165","TextValue"=>"<line-height=130%>Verwende Gold, um Totems zu kaufen!"],
12774=>["Value"=>12774,"TextKey"=>"新手引导说明3166","TextValue"=>"<line-height=130%>Der Preis für die Totems erhöht sich nach jedem Kauf. Geh und hole noch mehr Gold."],
12775=>["Value"=>12775,"TextKey"=>"新手引导说明2270","TextValue"=>"<line-height=130%>Dieses Level hat ein<color=#f58c26>Zeitlimit</color>. Du musst die Prüfung innerhalb der angegebenen Zeit abschließen, sonst verlierst du."],
12776=>["Value"=>12776,"TextKey"=>"新手引导说明2271","TextValue"=>"<line-height=130%> Du kannst hier überprüfen, wie viel Zeit du übrig hast."],
12777=>["Value"=>12777,"TextKey"=>"新手引导说明2273","TextValue"=>"<line-height=130%>Wenn die verbleibende Zeit weniger wird, wechselt die Farbe der Zahlen von <color=#46bb83>Grün</color> zu <color=#eca852>Gelb</color> und schließlich zu <color=#e04030>Rot</color>."],
12778=>["Value"=>12778,"TextKey"=>"新手引导说明2274","TextValue"=>"<line-height=130%>Um das Level schneller zu schaffen, kannst du im Shop nachsehen."],
12779=>["Value"=>12779,"TextKey"=>"新手引导说明2277","TextValue"=>"<line-height=130%>Du kannst <color=#38c0a5>Rubinen</color>verwenden, um ein Schlüsselobjekt vom Shop direkt zu kaufen."],
12780=>["Value"=>12780,"TextKey"=>"新手引导说明2281","TextValue"=>"<line-height=130%>Bei dieser Art von Leveln erhälst du ein <color=#38c0a5>Stammesmitglied</color> als Belohnung. Du kannst <color=#38c0a5>Rubine </color>ausgeben, um deine Belohnungen zu verdoppeln."],
12781=>["Value"=>12781,"TextKey"=>"新手引导说明2290","TextValue"=>"<line-height=130%>Willkommen zu einer weiteren Gottesprüfung! Du erhälst auch eine Belohnung, nachdem du die Herausforderung gemeistert hast."],
12782=>["Value"=>12782,"TextKey"=>"新手引导说明2291","TextValue"=>"<line-height=130%>Du kannst eine Prüfung <color=#f58c26>dreimal</color> abschließen, aber das Zeitlimit wird jedes Mal kürzer."],
12783=>["Value"=>12783,"TextKey"=>"新手引导说明3149","TextValue"=>"<line-height=130%>Du musst die Trainingseinheit des Helden abwarten, um aufzuleveln, oder du kannst <color=#38c0a5>Rubine</color> ausgeben, um den Prozess zu beschleunigen."],
12784=>["Value"=>12784,"TextKey"=>"新手引导说明2300","TextValue"=>"<line-height=130%>Sieh mal, das ist eine <color=#46bb83>Einlege-Nische</color>, sie kontrolliert einen großen Bereich des Nebels."],
12785=>["Value"=>12785,"TextKey"=>"新手引导说明2301","TextValue"=>"<line-height=130%>Ziehe das entsprechende Objekt in die Nische, um den Nebel zu lichten."],
12786=>["Value"=>12786,"TextKey"=>"新手引导说明2302","TextValue"=>"<line-height=130%>Wenn die Nische noch ruht, dann musst du sie erst einmal aufwecken."],
12787=>["Value"=>12787,"TextKey"=>"新手引导说明2400","TextValue"=>"<line-height=130%>Willkommen zu einem Event! Es wird nur für eine begrenzte Zeit verfügbar sein."],
12788=>["Value"=>12788,"TextKey"=>"新手引导说明2401","TextValue"=>"<line-height=130%>Wenn du an einem Event teilnimmst, erhälst du jede Menge Belohnungen, und diese werden an dein Heimatland geschickt!"],
12789=>["Value"=>12789,"TextKey"=>"新手引导说明2402","TextValue"=>"<line-height=130%>Hier wirst du einige einzigartige Objekte, neue Kreaturen und neue Formen des Gameplays sehen!"],
12790=>["Value"=>12790,"TextKey"=>"新手引导说明3180","TextValue"=>"<line-height=130%>Fackeln sind notwendig, damit du in den Levels vorankommst! Sie füllen sich mit der Zeit wieder auf."],
12791=>["Value"=>12791,"TextKey"=>"新手引导说明3181","TextValue"=>"<line-height=130%>Du hast jetzt eine Menge Fackeln! Verwende sie, um in den Levels zu spielen!"],
12792=>["Value"=>12792,"TextKey"=>"新手引导说明1072","TextValue"=>"<line-height=130%>Von nun an kannst du deine<color=#38c0a5> Camp Rewards</color> überprüfen!"],
12793=>["Value"=>12793,"TextKey"=>"新手引导说明1073","TextValue"=>"<line-height=130%>Wenn es soweit ist, kannst du deine Belohnungen einfordern."],
12794=>["Value"=>12794,"TextKey"=>"新手引导说明1074","TextValue"=>"<line-height=130%>Je mehr Sterne du in den Levels bekommst, desto mehr Belohnungen erhälst du!"],
12795=>["Value"=>12795,"TextKey"=>"新手引导说明2235","TextValue"=>"<line-height=130%>Schau mal! Es ist gleich da drüben auf der Karte! Schalte es frei und sehe es dir an!"],
12796=>["Value"=>12796,"TextKey"=>"新手引导说明2310","TextValue"=>"<line-height=130%>Unser Scout hat einen neuen Platz für ein neues Camp gefunden, probiere es aus!"],
12797=>["Value"=>12797,"TextKey"=>"新手引导说明2315","TextValue"=>"<line-height=130%>Vielleicht treffen wir hier jemand wirklich Interessantes!"],
12798=>["Value"=>12798,"TextKey"=>"新手引导说明2320","TextValue"=>"<line-height=130%>Willkommen zum <color=#46bb83>Winterausflug Event</color>, eine wunderbare Welt wartet auf dich!"],
12799=>["Value"=>12799,"TextKey"=>"新手引导说明2321","TextValue"=>"<line-height=130%>Die Teilnahme an einem <color=#46bb83>Event</color> gibt dir tonnenweise Belohnungen, und sie werden in dein <color=#f58c26>Heimatland</color>geschickt!"],
12800=>["Value"=>12800,"TextKey"=>"新手引导说明2322","TextValue"=>"<line-height=130%>Hier wirst du einige einzigartige Objekte, neue Kreaturen und neue Formen des Gameplays sehen!"],
12801=>["Value"=>12801,"TextKey"=>"新手引导说明2330","TextValue"=>"<line-height=130%>Willkommen zum <color=#46bb83>Märchenstadt-Event</color>, eine wunderbare Welt wartet auf dich!"],
12802=>["Value"=>12802,"TextKey"=>"新手引导说明2331","TextValue"=>"<line-height=130%>Die Teilnahme an einem <color=#46bb83>Event</color> gibt dir tonnenweise Belohnungen, und sie werden in dein <color=#f58c26>Heimatland</color>geschickt!"],
12803=>["Value"=>12803,"TextKey"=>"新手引导说明2332","TextValue"=>"<line-height=130%>Hier wirst du einige einzigartige Objekte, neue Kreaturen und neue Formen des Gameplays sehen!"],
12804=>["Value"=>12804,"TextKey"=>"新手引导说明2340","TextValue"=>"<line-height=130%>Willkommen zum <color=#46bb83>Ab ans Meer!-Event</color>, eine wunderbare Welt wartet auf dich!"],
12805=>["Value"=>12805,"TextKey"=>"新手引导说明2341","TextValue"=>"<line-height=130%>Die Teilnahme an einem <color=#46bb83>Event</color> gibt dir tonnenweise Belohnungen, und sie werden in dein <color=#f58c26>Heimatland</color>geschickt!"],
12806=>["Value"=>12806,"TextKey"=>"新手引导说明2342","TextValue"=>"<line-height=130%>Hier wirst du einige einzigartige Objekte, neue Kreaturen und neue Formen des Gameplays sehen!"],
12807=>["Value"=>12807,"TextKey"=>"新手引导说明2350","TextValue"=>"<line-height=130%>Dies ist ein <color=#46bb83>spezielles Event-Punkte-Objekt</color> in Events. Tippe es an, um ein paar saftige <color=#46bb83>Ereignispunkte</color>zu erhalten!"],
12808=>["Value"=>12808,"TextKey"=>"新手引导说明2352","TextValue"=>"<line-height=130%>Diese Seite zeigt dir alle Belohnungen, die du durch das Sammeln von Punkten im Event erhalten kannst. Sobald du genug Punkte gesammelt hast, wird die entsprechende <color=#46bb83>Event-Punkte-Belohnung</color>an dein <color=#f58c26>Heimatland</color>gesendet."],
12809=>["Value"=>12809,"TextKey"=>"新手引导说明2353","TextValue"=>"Je mehr Punkte du sammelst, desto mehr Belohnungen erhälst du! Gehe etwas Spaß haben!"],
12810=>["Value"=>12810,"TextKey"=>"新手引导说明3200","TextValue"=>"<line-height=130%><color=#f58c26>Tägliche Aufgaben</color> sind verfügbar, geh und schau sie dir an!"],
12811=>["Value"=>12811,"TextKey"=>"新手引导说明3203","TextValue"=>"<line-height=130%>Es gibt jeden Tag mehrere <color=#f58c26>Tägliche Aufgaben</color> für dich. Du wirst jedes Mal belohnt, wenn du eine von ihnen erledigst."],
12812=>["Value"=>12812,"TextKey"=>"新手引导说明3205","TextValue"=>"<line-height=130%>Wenn du alle <color=#f58c26>Tägliche Aufgaben</color> erledigst, bekommst du einen <color=#f58c26>Zusatzpreis</color>! "],
12813=>["Value"=>12813,"TextKey"=>"新手引导说明2420","TextValue"=>"<line-height=130%>Hallo, ich bin Miau-Miau, und willkommen im <color=#46bb83>Miau-Miau</color> Königreich! Mein wunderbares Reich wartet auf dich!"],
12814=>["Value"=>12814,"TextKey"=>"新手引导说明2421","TextValue"=>"<line-height=130%>Die Teilnahme an einem <color=#46bb83>Event</color> gibt dir tonnenweise Belohnungen, und sie werden in dein <color=#f58c26>Heimatland</color>geschickt!"],
12815=>["Value"=>12815,"TextKey"=>"新手引导说明2422","TextValue"=>"<line-height=130%>Hier wirst du einige einzigartige Objekte, neue Kreaturen (mich!) und neue Formen des Gameplays sehen!"],
12816=>["Value"=>12816,"TextKey"=>"新手引导说明2430","TextValue"=>"Wo sind wir? Wir sind im alten Ägypten, wo <color=#46bb83>Das Geheimnis des Pharaos</color> darauf wartet, von dir enthüllt zu werden!"],
12817=>["Value"=>12817,"TextKey"=>"新手引导说明2431","TextValue"=>"<line-height=130%>Die Teilnahme an einem <color=#46bb83>Event</color> gibt dir tonnenweise Belohnungen, und sie werden in dein <color=#f58c26>Heimatland</color>geschickt!"],
12818=>["Value"=>12818,"TextKey"=>"新手引导说明2432","TextValue"=>"<line-height=130%>Hier wirst du einige einzigartige Objekte, neue Kreaturen und neue Formen des Gameplays sehen!"],
12819=>["Value"=>12819,"TextKey"=>"新手引导说明2460","TextValue"=>"Howdy Partner! Willkommen im <color=#46bb83>Wilden Westen</color>!"],
12820=>["Value"=>12820,"TextKey"=>"新手引导说明2461","TextValue"=>"<line-height=130%>Die Teilnahme an einem <color=#46bb83>Event</color> gibt dir tonnenweise Belohnungen, und sie werden in dein <color=#f58c26>Heimatland</color>geschickt!"],
12821=>["Value"=>12821,"TextKey"=>"新手引导说明2462","TextValue"=>"<line-height=130%>Hier wirst du einige einzigartige Objekte, neue Kreaturen und neue Formen des Gameplays sehen!"],
12822=>["Value"=>12822,"TextKey"=>"新手引导说明2470","TextValue"=>"Das Wetter ist großartig. Lass uns<color=#46bb83> das perfekte Picknick</color> veranstalten!"],
12823=>["Value"=>12823,"TextKey"=>"新手引导说明2471","TextValue"=>"<line-height=130%>Die Teilnahme an einem <color=#46bb83>Event</color> wie diesem beschert dir jede Menge Belohnungen, und sie werden in dein <color=#f58c26>Heimatland</color>geschickt!!"],
12824=>["Value"=>12824,"TextKey"=>"新手引导说明2472","TextValue"=>"<line-height=130%>Hier wirst du einige einzigartige Objekte, neue Kreaturen und neue Formen des Gameplays sehen!"],
12825=>["Value"=>12825,"TextKey"=>"新手引导说明2500","TextValue"=>"<line-height=130%>Dies ist ein spezielles <color=#46bb83>Eventpunkte-Objekt</color> in Events. Tippe es an, um ein paar saftige <color=#46bb83>Eventpunkte</color>zu erhalten!"],
12826=>["Value"=>12826,"TextKey"=>"新手引导说明2502","TextValue"=>"<line-height=130%>Diese Seite zeigt dir alle Belohnungen, die du durch das Sammeln von Punkten im Event erhalten kannst. Sobald du genug Punkte gesammelt hast, wird die entsprechende <color=#46bb83>Event-Punkte-Belohnung</color> an dein <color=#f58c26>Heimatland</color> geschickt."],
12827=>["Value"=>12827,"TextKey"=>"新手引导说明2503","TextValue"=>"Je mehr Punkte du sammelst, desto mehr Belohnungen bekommst du! Geh und hab ein bisschen Spaß!"],
12828=>["Value"=>12828,"TextKey"=>"新手引导说明2510","TextValue"=>"Verwirkliche deinen Kindheitstraum im <color=#46bb83>Spielzeug Paradies</color>!"],
12829=>["Value"=>12829,"TextKey"=>"新手引导说明2511","TextValue"=>"<line-height=130%>Die Teilnahme an einem <color=#46bb83>Event</color> wie diesem beschert dir jede Menge Belohnungen, und sie werden in dein <color=#f58c26>Heimatland</color>geschickt!!"],
12830=>["Value"=>12830,"TextKey"=>"新手引导说明2512","TextValue"=>"<line-height=130%>Hier wirst du einige einzigartige Objekte, neue Kreaturen und neue Formen des Gameplays sehen!"],
12831=>["Value"=>12831,"TextKey"=>"新手引导说明2520","TextValue"=>"<line-height=130%>Dies ist ein spezielles <color=#46bb83>Eventpunkte-Objekt</color> in Events. Tippe es an, um ein paar saftige <color=#46bb83>Eventpunkte</color>zu erhalten!"],
12832=>["Value"=>12832,"TextKey"=>"新手引导说明2522","TextValue"=>"<line-height=130%>Diese Seite zeigt dir alle Belohnungen, die du durch das Sammeln von Punkten im Event erhalten kannst. Sobald du genug Punkte gesammelt hast, wird die entsprechende <color=#46bb83>Event-Punkte-Belohnung</color> an dein <color=#f58c26>Heimatland</color> geschickt."],
12833=>["Value"=>12833,"TextKey"=>"新手引导说明2523","TextValue"=>"Je mehr Punkte du sammelst, desto mehr Belohnungen bekommst du! Geh und hab ein bisschen Spaß!"],
12834=>["Value"=>12834,"TextKey"=>"新手引导说明2530","TextValue"=>"Der Sommer ist der beste! Komm und hab Spaß am <color=#46bb83>Strandurlaub</color>!"],
12835=>["Value"=>12835,"TextKey"=>"新手引导说明2531","TextValue"=>"<line-height=130%>Die Teilnahme an einem <color=#46bb83>Event</color> wie diesem beschert dir jede Menge Belohnungen, und sie werden in dein <color=#f58c26>Heimatland</color>geschickt!!"],
12836=>["Value"=>12836,"TextKey"=>"新手引导说明2532","TextValue"=>"<line-height=130%>Hier wirst du einige einzigartige Objekte, neue Kreaturen und neue Formen des Gameplays sehen!"],
12837=>["Value"=>12837,"TextKey"=>"新手引导说明2534","TextValue"=>"Ziehe den <color=#df66a8>Flinken Arbeiter</color> zum Bauen auf Gebäude oder Gegenstände. Er kann kurze Bauarbeiten im Handumdrehen ausführen oder die Zeit für lange Bauarbeiten um 1 Stunde verkürzen."],
12838=>["Value"=>12838,"TextKey"=>"新手引导说明2540","TextValue"=>"Willkommen im <color=#f58c26> Heimat der Helden </color>. Viele faszinierende Helden und Geschichten sind hier versteckt und warten darauf, von dir entdeckt zu werden!"],
12839=>["Value"=>12839,"TextKey"=>"新手引导说明2541","TextValue"=>"Führe sie zusammen, indem du ein <color=#ef933d>Prinzessinnen-Kleid</color> auf die anderen beiden ziehst, und hilf uns, die <color=#df66a8>Stammesprinzessin</color> aus dem bösen Nebel zu befreien."],
12840=>["Value"=>12840,"TextKey"=>"新手引导说明2542","TextValue"=>"Fantastisch! Du hast den ersten Helden befreit - <color=#df66a8> Stammesprinzessin </color>!  <color=#df66a8> Stammesprinzessin </color> hat dir eine Bestellung von Delikatessen gebracht. Tippe darauf und probiere es aus!"],
12841=>["Value"=>12841,"TextKey"=>"新手引导说明2543","TextValue"=>"Herzlichen Glückwunsch! Du hast <color=#ef933d>Weizen</color> freigeschaltet, welches eine wichtige Zutat für die Ausführung von Bestellungen ist. Tippe auf den <color=#ef933d>Weizen</color>, um ihn einzusammeln!"],
12842=>["Value"=>12842,"TextKey"=>"新手引导说明2544","TextValue"=>"<color=#38c0a5>Zauberbücher</color> können dir helfen, den Nebel aufzulösen und mehr Helden zu befreien. Du kannst <color=#38c0a5>Zauberbücher</color> erhalten, indem du Bestellungen erfüllst."],
12843=>["Value"=>12843,"TextKey"=>"新手引导说明2631","TextValue"=>"My Kingdom and my people are lost in the fog! Can you please <color=#ef933d>Merge</color> three Imperial Crowns to help me?"],
12844=>["Value"=>12844,"TextKey"=>"新手引导说明2633","TextValue"=>"Hey! I am the Old King Hill! It seems like you are the one who woke me up!"],
12845=>["Value"=>12845,"TextKey"=>"新手引导说明2636","TextValue"=>"<color=#ef933d>Merge 3 items</color> of the <color=#ef933d>Same Kind</color> together to clear fog and unlock <color=#ef933d>New heroes</color> and other fun things."],
12846=>["Value"=>12846,"TextKey"=>"新手引导说明2637","TextValue"=>"Drag this plant onto the other two. It will be leveled up to a <color=#ef933d>New Plant</color>. Give it a try!"],
12847=>["Value"=>12847,"TextKey"=>"新手引导说明2639","TextValue"=>"Good job! Keep merging by dragging this plant onto the others. You will get an upgraded <color=#ef933d>New Plant</color>."],
12848=>["Value"=>12848,"TextKey"=>"新手引导说明2641","TextValue"=>"Keep merging the plants. You will get a <color=#ef933d>New Plant</color> of the next level."],
12849=>["Value"=>12849,"TextKey"=>"新手引导说明2643","TextValue"=>"Repeat this move and see what is the <color=#ef933d>New Plant</color> looks like."],
12850=>["Value"=>12850,"TextKey"=>"新手引导说明2645","TextValue"=>"Last step! Drag the plant you just got onto the other two same ones and you'll get a <color=#ef933d>New Plant</color> ready for harvest! "],
12851=>["Value"=>12851,"TextKey"=>"新手引导说明2649","TextValue"=>"Ahh! It's bread! It smells soo good! Let me have a taste!"],
12852=>["Value"=>12852,"TextKey"=>"新手引导说明2652","TextValue"=>"Use the spellbook now to see what's gonna happen!"],
12853=>["Value"=>12853,"TextKey"=>"新手引导说明2663","TextValue"=>"Let's try merge 5 things together and see what's gonna happen！"],
12854=>["Value"=>12854,"TextKey"=>"新手引导说明2665","TextValue"=>"Anytime when you merge 5 items together, you will get <color=#ef933d>2 Items</color> of the next level. Don't forget the rules of <color=#ef933d>3 Merge</color> and <color=#ef933d>5 Merge</color>!"],
12855=>["Value"=>12855,"TextKey"=>"新手引导说明2671","TextValue"=>"Attention! This <color=#ef933d>Crystal</color> looks magical. Let's see what's going to happen if we merge three crystals together!"],
12856=>["Value"=>12856,"TextKey"=>"新手引导说明2673","TextValue"=>"<color=#ef933d>Advanced Magic Crytal</color> can be merged with any other two items. Kind of like the wild card in poker games. Try to merge this Magic Crytal with others."],
12857=>["Value"=>12857,"TextKey"=>"新手引导说明2675","TextValue"=>"Remember the <color=#ef933d>Advanced Magic Crytal</color> can be played as a wild card!"],
12858=>["Value"=>12858,"TextKey"=>"新手引导说明2676","TextValue"=>"Use <color=#ef933d>Speedy Workers</color> to complete construction immediately!"],
12859=>["Value"=>12859,"TextKey"=>"新手引导说明2678","TextValue"=>"<color=#ef933d>Speedy Workers</color> have ultra-high efficiency. <color=#ef933d>Drag</color> one onto a building to be constructed to see what's gonna happen!"],
12860=>["Value"=>12860,"TextKey"=>"新手引导说明2686","TextValue"=>"Complete each <color=#ef933d>Task</color> will gain you <color=#ef933d>Experience Points</color> which will upgrade your levels in the game. Tap on the Task button to learn more about it."],
12861=>["Value"=>12861,"TextKey"=>"新手引导说明2688","TextValue"=>"Do you need more <color=#ef933d>Construction Materials</color>，<color=#ef933d>Chests</color> or <color=#ef933d>Other Items</color> for help？Now the Store is open and go check what's on the shelves! There is a <color=#ef933d>Free Chest</color> for you to collect."],
