13617=>["Value"=>13617,"TextKey"=>"天气雷描述100001","TextValue"=>"Setze einen Blitz auf ein Objekt, um gleiche Objekte zusammen zu ziehen."],
13618=>["Value"=>13618,"TextKey"=>"剧情ID1010101","TextValue"=>"<line-height=130%>Hallo mein Häuptling, ich bin Tristan, dein Späher! Ich bin froh, dass wir alle diese holprige Reise überlebt haben. Wir haben endlich Land erreicht, also lasst uns ein <color=#f58c26>Lager</color> errichten. "],
13619=>["Value"=>13619,"TextKey"=>"剧情ID1010102","TextValue"=>"<line-height=130%>Das ist ziemlich üppig! Wer weiß, was uns hier begegnen könnte! Lasst uns erst einmal unser Zelt aufstellen, um uns zu schützen!"],
13620=>["Value"=>13620,"TextKey"=>"剧情ID1010201","TextValue"=>"<line-height=130%>Ach du lieber Gott, sieh dir diesen hässlichen Dreck an... und dieses hässliche Zelt! Ich vermisse mein Zuhause so sehr..."],
13621=>["Value"=>13621,"TextKey"=>"剧情ID1010202","TextValue"=>"Nun, Edna, ich weiß, dass es schwer ist, sein Zuhause zu verlassen, aber der einzige Weg, es zu retten, war zu gehen. All diese bizzaren Katastrophen...wir müssen eine Antwort finden! Deshalb dachten wir, dass wir nach Hilfe suchen müssen."],
13622=>["Value"=>13622,"TextKey"=>"剧情ID1010203","TextValue"=>"<line-height=130%> Aber wir werden einen Weg zurück finden, ok? Fangen wir damit an, einen <color=#f58c26>Altar</color> zu bauen, damit du mit Gott sprechen kannst, wie wäre das, Priester Edna? Der Häuptling wird helfen!"],
13623=>["Value"=>13623,"TextKey"=>"剧情ID1020101","TextValue"=>"<line-height=130%>Sieh mal, was wir gefunden haben! <color=#ef933d>Wildes Erbe</color>! Das ist alles, was wir für den <color=#f58c26>Altar</color> brauchen, und wir haben einen Weg gefunden, uns von diesen Totems zu befreien! Dieser Ort ist gesegnet!"],
13624=>["Value"=>13624,"TextKey"=>"剧情ID1020201","TextValue"=>"<line-height=130%>Ich schätze, du bist nicht völlig nutzlos, Stan oder so. Es ist zwar viel kleiner und unscheinbarer als das, was ich zu Hause hatte, aber für den Moment wird es reichen! Und jetzt geh!"],
13625=>["Value"=>13625,"TextKey"=>"剧情ID1020202","TextValue"=>"<line-height=130%>Hach, wie süß, schau dir an, wie glücklich sie ist und ihre sehr verdrehte Art, danke zu sagen!"],
13626=>["Value"=>13626,"TextKey"=>"剧情ID1020203","TextValue"=>"<line-height=130%> (Beendet einen seltsamen Tanz) Unser Gott sagte mir, dass wir am richtigen Ort sind und eine große Gestalt kommen wird, um uns zu helfen..."],
13627=>["Value"=>13627,"TextKey"=>"剧情ID1020204","TextValue"=>"<line-height=130%>Wirklich? Das ist eine großartige Nachricht! Wann werden wir diese große Gestalt treffen?"],
13628=>["Value"=>13628,"TextKey"=>"剧情ID1020301","TextValue"=>"<line-height=130%>Seid ihr die Schurken, die meinen Schlummer gestört haben?! "],
13629=>["Value"=>13629,"TextKey"=>"剧情ID1020302","TextValue"=>"<line-height=130%>... Und du bist?"],
13630=>["Value"=>13630,"TextKey"=>"剧情ID1020303","TextValue"=>"<line-height=130%>Ich bin der Erzdruide, Vater der Barden, Bezwinger der Stürme, Beschützer der Werber, der furchteinflößende Bote Gottes, Vollstrecker und Richter, der singende Amergin! "],
13631=>["Value"=>13631,"TextKey"=>"剧情ID1020304","TextValue"=>"<line-height=130%>Aha...Schön, dich kennenzulernen, denke ich? Wir sind neu in der Gegend und wir haben gerade gehört..."],
13632=>["Value"=>13632,"TextKey"=>"剧情ID1020305","TextValue"=>"<line-height=130%>Was?! Ihr seid Eindringlinge?! Ihr sollt keine Chance haben, unsere Heimat zu zerstören und Familien auseinander zu bringen! "],
13633=>["Value"=>13633,"TextKey"=>"剧情ID1020401","TextValue"=>"Was? Nein, nein! Wir sind keine Eindringlinge, wir versuchen nur einen Platz zum Ausruhen zu finden, und vielleicht das Geheimnis unserer Heimat zu lösen."],
13634=>["Value"=>13634,"TextKey"=>"剧情ID1020402","TextValue"=>"Nein! Die Brücke! Seht euch an, was ihr angerichtet habt! Gott wird wütend sein! Warte...Wer sagtest du, bist du? Amergin? Amergin, der Erzdruide? Aus den Legenden?!"],
13635=>["Value"=>13635,"TextKey"=>"剧情ID1020403","TextValue"=>"Ihr seid... keine Eindringlinge? Wer seid ihr? Warum seid ihr hier? Warte... Warum bin ich hier und was ist das für ein Ort? Wo ist mein Volk? Ich erinnere mich nicht an dieses Land."],
13636=>["Value"=>13636,"TextKey"=>"剧情ID1020404","TextValue"=>"Es tut mir so leid, aber wir haben auch keine Antworten. Wir sind weit gereist, haben unser Leben riskiert, um hierher zu gelangen und versuchen, Helfer zu finden, die das Geheimnis unserer Heimat lösen können. Erst fiel ein dichter Nebel über uns, dann..."],
13637=>["Value"=>13637,"TextKey"=>"剧情ID1020405","TextValue"=>"Wir hatten im letzten Jahr mehr Überschwemmungen als im letzten Jahrzehnt. Doch am merkwürdigsten ist, dass sich die Menschen in leblose Totems verwandelt haben! Kannst du das glauben?!"],
13638=>["Value"=>13638,"TextKey"=>"剧情ID1020406","TextValue"=>"Oh... das ist... eine Menge zu verkraften. Es tut mir leid, dass ich dich angegriffen und deine Brücke zerstört habe. Vielleicht kann ich beim Wiederaufbau helfen?"],
13639=>["Value"=>13639,"TextKey"=>"剧情ID1020407","TextValue"=>"Amergin?! Der mächtige Amergin?! Deine Robe, deine Macht, den Sturm zu befehlen... Du bist echt! Das bedeutet, dass die Geschichten aus dem Buch meiner Familie wahr sind!"],
13640=>["Value"=>13640,"TextKey"=>"剧情ID1020408","TextValue"=>"<line-height=130%>Arbeiter! Reißt euch zusammen und baut die Brücke wieder auf!"],
13641=>["Value"=>13641,"TextKey"=>"剧情ID1020409","TextValue"=>"<line-height=130%>Aber wir sind verletzt! Wir können jetzt nicht mit dem Bau beginnen! "],
13642=>["Value"=>13642,"TextKey"=>"剧情ID1020410","TextValue"=>"Ich weiß genau das Richtige. Ich habe durch jahrelanges Reisen etwas über Kräutermedizin gelernt. Lass uns ein paar Kräuter sammeln und hier einen <color=#f58c26>Kräutergarten</color> anlegen, als meine Art, mich zu entschuldigen."],
13643=>["Value"=>13643,"TextKey"=>"剧情ID1020411","TextValue"=>"Ich danke Euch! Das ist sehr nett. Wir werden später auch nach Hause zurückkehren, um die in den Totems gefangenen zu befreien, jetzt, wo wir gelernt haben, wie das geht! Großartig, lasst uns gehen!"],
13644=>["Value"=>13644,"TextKey"=>"剧情ID1030101","TextValue"=>"<line-height=130%>Wir sind zurück, und wir haben Helfer von zu Hause mitgebracht! Dann lasst uns den Garten bauen!"],
13645=>["Value"=>13645,"TextKey"=>"剧情ID1030201","TextValue"=>"<line-height=130%>Wow, ich kann nicht sagen, dass ich nicht beeindruckt bin, du bist wirklich gut darin. Dieser kleine Garten ist wunderschön. "],
13646=>["Value"=>13646,"TextKey"=>"剧情ID1030202","TextValue"=>"<line-height=130%>Und auch sehr nützlich. Die Arbeiter sind nun behandelt und werden bald bereit sein, die Brücke wieder aufzubauen!"],
13647=>["Value"=>13647,"TextKey"=>"剧情ID1030203","TextValue"=>"<line-height=130%>Schön, dass ich helfen konnte."],
13648=>["Value"=>13648,"TextKey"=>"剧情ID1030204","TextValue"=>"Wo wir gerade dabei sind, der Priester hier hat gerade darüber gesprochen, wie tugendhaft und kenntnisreich du bist. Was ich zu sagen versuche ist..."],
13649=>["Value"=>13649,"TextKey"=>"剧情ID1030205","TextValue"=>"Es wäre eine Ehre, wenn sich ein erfahrener Abenteurer und eine große Persönlichkeit wie du uns anschließen könnte. Aber du bist eine Legende! Auf keinen Fall wirst du dich irgendwelchen seltsamen Fremden anschließen! Willst du? Bitte! Bitte komm mit uns!!!"],
13650=>["Value"=>13650,"TextKey"=>"剧情ID1030206","TextValue"=>"<line-height=130%>Sicher, vielleicht bin ich genau deshalb hierher geschickt worden."],
13651=>["Value"=>13651,"TextKey"=>"剧情ID1030207","TextValue"=>"<line-height=130%>Ich wusste es. Du wirst nicht... WAS? Du kommst mit uns?! Oh ich kann es nicht glauben... Das ist der beste Tag meines Lebens. "],
13652=>["Value"=>13652,"TextKey"=>"剧情ID1030208","TextValue"=>"Entschuldige bitte, sie kann manchmal zu aufgeregt sein. Wie wäre es, wenn wir eine Willkommensparty für dich veranstalten, jetzt wo du bei uns bist?"],
13653=>["Value"=>13653,"TextKey"=>"剧情ID1030209","TextValue"=>"Nein, es geht auch ohne Party, ich habe dringendere Angelegenheiten zu erledigen. Ich werde mich auf die Suche nach Holz machen, um die Brücke wieder aufzubauen, die ich kaputt gemacht habe."],
13654=>["Value"=>13654,"TextKey"=>"剧情ID1030210","TextValue"=>"<line-height=130%>Was für ein ehrenwerter Mann! Oh! Ihn nur zu treffen... ist der beste Tag meines LEBENS!"],
13655=>["Value"=>13655,"TextKey"=>"剧情ID1040101","TextValue"=>"<line-height=130%>Du bist der Häuptling... richtig? Danke für deine Hilfe dort hinten. Jetzt sind wir bereit, die Brücke wieder aufzubauen."],
13656=>["Value"=>13656,"TextKey"=>"剧情ID1040201","TextValue"=>"<line-height=130%>So gut wie neu! Bist du aufgeregt, wieder mit Gott zu sprechen, Priesterin Edna?"],
13657=>["Value"=>13657,"TextKey"=>"剧情ID1040202","TextValue"=>"<line-height=130%>So bereit wie noch nie! "],
13658=>["Value"=>13658,"TextKey"=>"剧情ID1040301","TextValue"=>"<line-height=130%>Ok, Häuptling, während der Priester sein Wiedersehen mit seinem geliebten Altar genießt, können wir mit der Arbeit beginnen..."],
13659=>["Value"=>13659,"TextKey"=>"剧情ID1040401","TextValue"=>"Autsch, worüber bin ich gestolpert? Aha, ein Stück <color=#38c0a5>Wildes Erz</color> vom <color=#f58c26>Altar</color>. Ihr seid furchtbar unvorsichtig, wenn ihr arbeitet."],
13660=>["Value"=>13660,"TextKey"=>"剧情ID1040402","TextValue"=>"<line-height=130%>Ah ha, ich weiß! Wir müssen ein <color=#f58c26>Lagerhaus</color> bauen, um die Rohstoffe zu lagern, damit die Leute nicht über die Materialien stolpern, die überall herumliegen."],
13661=>["Value"=>13661,"TextKey"=>"剧情ID1050101","TextValue"=>"<line-height=130%>Hast du alles, was wir brauchen? Dann kann die Party ja losgehen! Entschuldigung, ich meine das <color=#f58c26>Lagerhaus</color>."],
13662=>["Value"=>13662,"TextKey"=>"剧情ID1050201","TextValue"=>"<line-height=130%>Feste Wand, schöner und großer Raum...Tolle Baukünste, Häuptling!"],
13663=>["Value"=>13663,"TextKey"=>"剧情ID1050202","TextValue"=>"<line-height=130%>Ähm... Da ist ein achtbeiniges Ding direkt hinter dir."],
13664=>["Value"=>13664,"TextKey"=>"剧情ID1050301","TextValue"=>"Was?! Wie?! Was ist das?! Es sieht aus wie der Körper einer Wasserkreatur... hmm, und die Haut ist schleimig und dehnbar!"],
13665=>["Value"=>13665,"TextKey"=>"剧情ID1050302","TextValue"=>"<line-height=130%><color=#f58c26>Kraken</color>! Es ist ein <color=#f58c26>Kraken</color>! Ich habe in meinen Büchern über sie gelesen! Es muss ein Baby dieses Monsters sein! Warum gibt es einen <color=#f58c26>Kraken</color>?!"],
13666=>["Value"=>13666,"TextKey"=>"剧情ID1050303","TextValue"=>"Es gibt keinen Grund zur Panik. Erstens ist er definitiv tot, und zweitens ist das nur ein gestrandeter gewöhnlicher <color=#f58c26>Oktopus</color>."],
13667=>["Value"=>13667,"TextKey"=>"剧情ID1050304","TextValue"=>"<line-height=130%>Oktopus? Noch nie davon gehört..."],
13668=>["Value"=>13668,"TextKey"=>"剧情ID1050305","TextValue"=>"Das bedeutet, dass ihr aus dem Landesinneren kommen müsst, was? Mein Volk ist ein Nomadenvolk. Wir sind auf das Meer angewiesen. Kraken sind für uns so gewöhnlich wie Sterne am Nachthimmel."],
13669=>["Value"=>13669,"TextKey"=>"剧情ID1050306","TextValue"=>"Komm mit mir, lass uns ein paar Seile und Äste suchen. Ich zeige dir, wie man mit der Haut eines Oktopus ein Zelt baut."],
13670=>["Value"=>13670,"TextKey"=>"剧情ID1060101","TextValue"=>"<line-height=130%>Uuuund... fertig. In meiner Vorstellung sah es viel besser aus."],
13671=>["Value"=>13671,"TextKey"=>"剧情ID1060102","TextValue"=>"<line-height=130%>Es ist... ähm... süß."],
13672=>["Value"=>13672,"TextKey"=>"剧情ID1060103","TextValue"=>"Sorry! Ich bin eher ein Theorie- als ein Praxismensch. Konstruktion ist nicht meine starke Seite. Jetzt... muss ich mich vielleicht mal hinlegen..."],
13673=>["Value"=>13673,"TextKey"=>"剧情ID1060104","TextValue"=>"Oh toll, Amergin! Warum gehst du nicht und ruhst dich im Hauptzelt aus, und ich werde deine Gesellschaft sein! Du hast mir deine Weisheit vermittelt, und ich werde dir immer zu Diensten sein."],
13674=>["Value"=>13674,"TextKey"=>"剧情ID1060201","TextValue"=>"Für den Priester muss ein Kindheitstraum in Erfüllung gegangen sein. Ich bin froh zu sehen, dass die beiden miteinander auskommen. Trotzdem kommt mir alles ein wenig seltsam vor, meinst du nicht auch, Häuptling?"],
13675=>["Value"=>13675,"TextKey"=>"剧情ID1060202","TextValue"=>"Die Ältesten sagten, dass diejenigen, die zum Meer reisten, nie wieder zurückkamen, bis auf den einen, der als Verrückter zurückkam und von einer riesigen Barriere aus Wasser am Rande der Welt sprach."],
13676=>["Value"=>13676,"TextKey"=>"剧情ID1060203","TextValue"=>"<line-height=130%>Doch dieser Amergin sagte, sie seien Menschen des Meeres! Kein Volk lebt auf dem Meer!"],
13677=>["Value"=>13677,"TextKey"=>"剧情ID1060204","TextValue"=>"<line-height=130%>Deswegen ist das ja auch seltsam. Aber wie auch immer, er hat uns nichts getan. Bleiben wir erst einmal bei unseren Aufgaben. "],
13678=>["Value"=>13678,"TextKey"=>"剧情ID1060205","TextValue"=>"<line-height=130%>Jetzt, wo du dich umgesehen hast, ist die Menge an Trophäen, die wir gefunden haben, überwältigend. Ein paar Tiere können helfen, sie nach Hause zu tragen. Und für ihren Komfort sollten wir ihnen einen <color=#f58c26>Viehstall</color> bauen."],
13679=>["Value"=>13679,"TextKey"=>"剧情ID1070101","TextValue"=>"<line-height=130%>Sieht gut aus, Häuptling! Es sieht so aus, als würden sich diese kleinen Kerle sofort als nützlich erweisen, fantastisch!"],
13680=>["Value"=>13680,"TextKey"=>"剧情ID1070102","TextValue"=>"<line-height=130%>Wir sind fast fertig mit den Konstruktionen, allerdings gibt es noch eine letzte Sache, bei der ich deine Hilfe brauche."],
13681=>["Value"=>13681,"TextKey"=>"剧情ID1070103","TextValue"=>"<line-height=130%>Für den Fall, dass ein paar Böswillige kommen und unser Lager ruinieren, sobald wir es verlassen haben, brauchen wir ein professionelles Spähtrupp-Team, das die Gegend patrouilliert und unsere Arbeit hier schützt."],
13682=>["Value"=>13682,"TextKey"=>"剧情ID1070104","TextValue"=>"<line-height=130%>Wir brauchen einen <color=#f58c26>Trainingsring</color>!"],
13683=>["Value"=>13683,"TextKey"=>"剧情ID1070105","TextValue"=>"<line-height=130%>Richtig Kevin, einen <color=#f58c26>Trainingsring</color>. Lass uns ein paar Materialien suchen!"],
13684=>["Value"=>13684,"TextKey"=>"剧情ID1080101","TextValue"=>"<line-height=130%>Bist du bereit?"],
13685=>["Value"=>13685,"TextKey"=>"剧情ID1080102","TextValue"=>"<line-height=130%>Ja, Sir!"],
13686=>["Value"=>13686,"TextKey"=>"剧情ID1080103","TextValue"=>"<line-height=130%>Der Häuptling ist mit der Vorbereitung der Materialien fertig, dann lasst uns loslegen!"],
13687=>["Value"=>13687,"TextKey"=>"剧情ID1080104","TextValue"=>"<line-height=130%>Ja, Sir! Kein Problem, Sir!"],
13688=>["Value"=>13688,"TextKey"=>"剧情ID1080201","TextValue"=>"<line-height=130%>Gute Arbeit! Und jetzt werden wir... Priester? Was ist denn los?"],
13689=>["Value"=>13689,"TextKey"=>"剧情ID1080301","TextValue"=>"Ich unterhielt mich mit dem Erzdruiden Amergin, dann schliefen wir beide vor Erschöpfung ein und hatten beide diesen seltsamen Traum, in dem eine Göttin zu uns sagte: "Rette das <color=#f58c26>Herz des Meeres</color>......""],
13690=>["Value"=>13690,"TextKey"=>"剧情ID1080302","TextValue"=>"<line-height=130%><color=#f58c26>Herz des Meeres</color>? Was ist das?"],
13691=>["Value"=>13691,"TextKey"=>"剧情ID1080303","TextValue"=>"Es gibt eine alte Sage über eine riesige Blase im Meer, die von der jüngsten der Göttinnen beschützt wird. In ihr haben nicht nur uralte Tiere überlebt, sondern es leben auch noch Riesen und Feen. Aber es ist einfach eine Gute-Nacht-Geschichte."],
13692=>["Value"=>13692,"TextKey"=>"剧情ID1080304","TextValue"=>"<line-height=130%>Ich muss der Sache auf den Grund gehen. Um eine klarere Botschaft von der Göttin zu erhalten, brauche ich eine <color=#f58c26>Mächtige Runenbasis</color>."],
13693=>["Value"=>13693,"TextKey"=>"剧情ID1080305","TextValue"=>"<line-height=130%>Verstanden. Okay, Häuptling, lass uns ein paar wilde Erze holen und die Basis für Edna bauen."],
13694=>["Value"=>13694,"TextKey"=>"剧情ID1090101","TextValue"=>"<line-height=130%>Wir sind fast fertig! Das müssen wir feiern!"],
13695=>["Value"=>13695,"TextKey"=>"剧情ID1090102","TextValue"=>"<line-height=130%>Hurra!"],
13696=>["Value"=>13696,"TextKey"=>"剧情ID1090201","TextValue"=>"<line-height=130%>Noch nicht feiern! Ich kann mich nicht konzentrieren, wenn du so zeternd bist!"],
13697=>["Value"=>13697,"TextKey"=>"剧情ID1090202","TextValue"=>"<line-height=130%>Ich habe versucht, mich wieder mit Gott zu verbinden und wurde von euch lärmenden Idioten ruiniert!"],
13698=>["Value"=>13698,"TextKey"=>"剧情ID1090203","TextValue"=>"<line-height=130%>Haltet euer Maul und lasst mich in Ruhe!"],
13699=>["Value"=>13699,"TextKey"=>"剧情ID1090204","TextValue"=>"<line-height=130%>Autsch, da hat wohl jemand keinen guten Tag."],
13700=>["Value"=>13700,"TextKey"=>"剧情ID1090205","TextValue"=>"<line-height=130%>Warte! Pssst! Ich glaube, ich kann sie hören. Das ist sehr wichtig."],
13701=>["Value"=>13701,"TextKey"=>"剧情ID1090206","TextValue"=>"Hmm... ich höre nicht sehr gut... aber was ich vermute ist... wir sollten nach Norden gehen, wo nichts wachsen und nichts leben kann. Dort werden wir einen Freund finden."],
13702=>["Value"=>13702,"TextKey"=>"剧情ID1090207","TextValue"=>"<line-height=130%>Okay, klingt... schaffbar? Ich meine, was kann schon passieren! Also nach Norden! "],
13703=>["Value"=>13703,"TextKey"=>"剧情ID1090208","TextValue"=>"Aber vorher ist es endlich an der Zeit für unser neues Lager zu feiern! Versammelt euch, denn wir werden eine große Party feiern!"],
13704=>["Value"=>13704,"TextKey"=>"剧情ID1090209","TextValue"=>"<line-height=130%>Hurra!"],
13705=>["Value"=>13705,"TextKey"=>"剧情ID1090301","TextValue"=>"Wir verließen unsere Heimat und dachten, dass wir vielleicht nie wieder zurückkehren würden, doch wir fanden diese unglaubliche Insel, trafen neue Freunde und fanden sogar Wege, Stammesmitglieder wiederzubeleben, von denen wir dachten, dass wir sie für immer verloren hätten."],
13706=>["Value"=>13706,"TextKey"=>"剧情ID1090302","TextValue"=>"Für all das müssen wir unserer Göttin danken, die auf uns aufgepasst hat und uns Führung gegeben hat, unserem neuen Freund, dem lieben Amergin, der uns selbstlos sein unglaubliches Wissen zur Verfügung gestellt hat."],
13707=>["Value"=>13707,"TextKey"=>"剧情ID1090303","TextValue"=>"Aber am wichtigsten ist, Häuptling, dass wir all das nicht hätten erreichen können, wenn du nicht stark und freundlich geblieben wärst. Also danke Häuptling, für alles, was du für uns getan hast, und Priester, weinst du etwa?"],
13708=>["Value"=>13708,"TextKey"=>"剧情ID1090304","TextValue"=>"Ich... Ich weine nicht... *schnief* Es ist nur... *schnief* Ok, ich weine! Ich weine! Seid ihr jetzt alle zufrieden?! Ich liebe dich Häuptling! Du bist der beste Häuptling!! "],
13709=>["Value"=>13709,"TextKey"=>"剧情ID1090305","TextValue"=>"Haha, ich glaube das sagt alles, Häuptling. Ich kann es kaum erwarten zu sehen, wie unsere Reise weitergeht, und eines Tages werden wir definitiv das Geheimnis unseres Heims auflösen und unser Heim wieder aufbauen."],
13710=>["Value"=>13710,"TextKey"=>"剧情ID2010101","TextValue"=>"<line-height=130%>Nicht hetzen Jungs, wir sind fast da..."],
13711=>["Value"=>13711,"TextKey"=>"剧情ID2010102","TextValue"=>"<line-height=130%>Gott segne dich! Wir laufen schon seit Tagen durch die Wüste, oder kannst du mir vielleicht etwas Wasser geben? "],
13712=>["Value"=>13712,"TextKey"=>"剧情ID2010103","TextValue"=>"<line-height=130%>Hab etwas Geduld! Als ich in deinem Alter war... Hey, was ist das?"],
13713=>["Value"=>13713,"TextKey"=>"剧情ID2010201","TextValue"=>"<line-height=130%>WOOOOWW"],
13714=>["Value"=>13714,"TextKey"=>"剧情ID2010202","TextValue"=>"<line-height=130%>Priester?!"],
13715=>["Value"=>13715,"TextKey"=>"剧情ID2010203","TextValue"=>"<line-height=130%>Oh nein, bist du da unten, mein Priester? Geht es dir gut?"],
13716=>["Value"=>13716,"TextKey"=>"剧情ID2010204","TextValue"=>"<line-height=130%>Nun... ich bin noch am Leben... Hmm, ich glaube, ich wurde von dieser... magischen Mine heruntergezogen?"],
13717=>["Value"=>13717,"TextKey"=>"剧情ID2010205","TextValue"=>"<line-height=130%>Oh, Gott sei Dank geht es dir gut, mach dir keine Sorgen, wir werden alles tun, um dich so schnell wie möglich da raus zu holen."],
13718=>["Value"=>13718,"TextKey"=>"剧情ID2010301","TextValue"=>"<line-height=130%>Häuptling, ich habe ein verlassenes Gebäude auf einer Hügelkuppe in der Nähe gefunden. Ich konnte eine große Strohseilmaschine darin sehen, aber sie ist von einem grässlichen Durcheinander umgeben."],
13719=>["Value"=>13719,"TextKey"=>"剧情ID2010302","TextValue"=>"<line-height=130%>Ich vermute, dass es sich um eine <color=#f58c26>alte Werkstatt</color>oder so etwas Ähnliches handelt."],
13720=>["Value"=>13720,"TextKey"=>"剧情ID2010303","TextValue"=>"<line-height=130%>Wir können versuchen, die Tür zu öffnen und sie zu säubern, damit wir eine Seilrolle bauen und den Priester herausziehen können."],
13721=>["Value"=>13721,"TextKey"=>"剧情ID2010304","TextValue"=>"<line-height=130%>Dann hör auf zu schwatzen und baue diesen Flaschenzug!"],
13722=>["Value"=>13722,"TextKey"=>"剧情ID2010305","TextValue"=>"Beruhige dich, Priester! Der Himmel verdunkelt sich, bald wird es hier draußen eiskalt! Also müssen wir erst einmal Materialien finden, um ein <color=#f58c26>Zelt</color> zu bauen, und versuchen, das zu klären, nachdem sich alle etwas ausgeruht haben."],
13723=>["Value"=>13723,"TextKey"=>"剧情ID2010306","TextValue"=>"<line-height=130%>Aber was ist mit mir?! Ich könnte erfrieren!"],
13724=>["Value"=>13724,"TextKey"=>"剧情ID2010307","TextValue"=>"<line-height=130%>Keine Sorge, obwohl der Temperaturunterschied zwischen Tag und Nacht über der Erde riesig ist, ist die Temperatur unter der Erde immer gleichmäßig und angenehm. Halte durch, Priester! "],
13725=>["Value"=>13725,"TextKey"=>"剧情ID2020101","TextValue"=>"Am nächsten Tag..."],
13726=>["Value"=>13726,"TextKey"=>"剧情ID2020201","TextValue"=>"<line-height=130%>Das war ein guter Nachtschlaf! Wie geht es dir da unten, mein Priester?"],
13727=>["Value"=>13727,"TextKey"=>"剧情ID2020202","TextValue"=>"<line-height=130%>Ich würde es zu schätzen wissen, wenn du deine Energie darauf verwenden würdest, mich hier rauszuholen, anstatt zu fragen, wie es mir geht!"],
13728=>["Value"=>13728,"TextKey"=>"剧情ID2020203","TextValue"=>"<line-height=130%>Wir arbeiten daran, ich brauche nur ein paar notwendige Werkzeuge, um die Tür aufzubrechen, bevor ich weitermache. Bitte bleib ruhig. *lächelt*"],
13729=>["Value"=>13729,"TextKey"=>"剧情ID2020204","TextValue"=>"<line-height=130%>Du wartest darauf, dass ich wieder aufstehe... Du respektlose und undankbare kleine Göre..."],
13730=>["Value"=>13730,"TextKey"=>"剧情ID2020205","TextValue"=>"<line-height=130%>Autsch, meine Gefühle sind sehr verletzt! Wie kommt es, dass du mein gutes Herz so missverstanden hast! Aber ich vergebe dir. Der Häuptling und ich werden sofort zurückkommen!"],
13731=>["Value"=>13731,"TextKey"=>"剧情ID2030201","TextValue"=>"Ok, wir sind drin! Jetzt brauchen wir nur noch..."],
13732=>["Value"=>13732,"TextKey"=>"剧情ID2030202","TextValue"=>"Pass auf, hinter dir!"],
13733=>["Value"=>13733,"TextKey"=>"剧情ID2030203","TextValue"=>"Autsch! Woher kommt dieser Pfeil?!"],
13734=>["Value"=>13734,"TextKey"=>"剧情ID2030204","TextValue"=>"Komm aus dem Gebäude!"],
13735=>["Value"=>13735,"TextKey"=>"剧情ID2030205","TextValue"=>"Wer ist da?"],
13736=>["Value"=>13736,"TextKey"=>"剧情ID2030206","TextValue"=>"Raus da! Ihr Kidnapper!"],
13737=>["Value"=>13737,"TextKey"=>"剧情ID2030207","TextValue"=>"Kidnapper? Ich glaube, du hast die falschen Leute erwischt, Stimmenfrau. Aua, aua, aua!"],
13738=>["Value"=>13738,"TextKey"=>"剧情ID2030301","TextValue"=>"Stimmenfrau, wir sind aus dem Gebäude, erklärst du mir jetzt, was hier los ist?"],
13739=>["Value"=>13739,"TextKey"=>"剧情ID2030302","TextValue"=>"Erstens, mein Name ist nicht Stimmenfrau, ich bin Tlachtga, Jägerin des Blitzes, Tochter von Mug Ruith, Mutter von allem Land, Heldin für..."],
13740=>["Value"=>13740,"TextKey"=>"剧情ID2030303","TextValue"=>"<size=100%>Große Tlachtga!!!!!!!"],
13741=>["Value"=>13741,"TextKey"=>"剧情ID2030304","TextValue"=>"Wa... Woher kommt diese Stimme... vom Fuß des Hügels? Ist jemand in diese Mine gefallen?"],
13742=>["Value"=>13742,"TextKey"=>"剧情ID2030305","TextValue"=>"Ihr drei, bleibt ganz ruhig, bis ich zurückkomme. Wenn ich herausfinde, dass ihr euch auch nur einen Zentimeter bewegt habt, wisst ihr, was passieren wird."],
13743=>["Value"=>13743,"TextKey"=>"剧情ID2030306","TextValue"=>"Ja, Ma'am, keinen Zentimeter!"],
13744=>["Value"=>13744,"TextKey"=>"剧情ID2030401","TextValue"=>"Da bist du ja. Ein Priester? Was machst du denn da unten? Ich habe den Eingang zu dieser Mine aufgebrochen, während ich nach jemandem gesucht habe, wie kommt es, dass du darin bist?"],
13745=>["Value"=>13745,"TextKey"=>"剧情ID2030402","TextValue"=>"Lange Rede, kurzer Sinn, ich war mit den drei Jungs unterwegs, die du da drüben gefangen hast, aber ich bin in diese Mine gefallen. Aber das ist nicht wichtig. Du bist hier! Ich habe vorausgesagt, dass wir einen Freund treffen werden, der uns in diesem kargen Land helfen kann, ich kann nicht glauben, dass du es bist!"],
13746=>["Value"=>13746,"TextKey"=>"剧情ID2030403","TextValue"=>"<line-height=130%>Freund? Dir helfen? Wobei? Ihr seid... keine Kidnapper?"],
13747=>["Value"=>13747,"TextKey"=>"剧情ID2030404","TextValue"=>"<line-height=130%>Kidnapper? Nein, nein, nein, wir sind nur Passanten, die auf der Suche nach Helfern sind, um unsere Heimat zu retten! *erklärt*"],
13748=>["Value"=>13748,"TextKey"=>"剧情ID2030405","TextValue"=>"Hm. Jetzt, wo du es sagst, hat Mama gesagt, dass sie eine Gruppe von Leuten wie euch getroffen hat... aber dann ist sie verschwunden... Das bedeutet also, dass ich die falschen Leute erwischt habe."],
13749=>["Value"=>13749,"TextKey"=>"剧情ID2030406","TextValue"=>"<line-height=130%>Mama?"],
13750=>["Value"=>13750,"TextKey"=>"剧情ID2030407","TextValue"=>"Vergiss das, keine große Sache. Ich nehme an, deine Jungs sind in meine Falle getappt, um die Seilmaschine in Gang zu setzen, damit sie dich herausfischen können?"],
13751=>["Value"=>13751,"TextKey"=>"剧情ID2030408","TextValue"=>"<line-height=130%>Ja weise Ma'am, das ist genau der Grund, und so sah ich am Ende aus, einfüßig."],
13752=>["Value"=>13752,"TextKey"=>"剧情ID2030409","TextValue"=>"Oh je, mein Fehler, ich werde dir später mit deiner Wunde helfen. Jetzt lass mich erst einmal meine Fallen entfernen und die Seilmaschine für dich reparieren..."],
13753=>["Value"=>13753,"TextKey"=>"剧情ID2030501","TextValue"=>"<line-height=130%>Die Strohseilmaschine steht und läuft, gute Arbeit, Ma'am!"],
13754=>["Value"=>13754,"TextKey"=>"剧情ID2030592","TextValue"=>"<line-height=130%>Ganz und gar nicht toll! Zieh mich hoch! Sofort, auf der Stelle!"],
13755=>["Value"=>13755,"TextKey"=>"剧情ID2030683","TextValue"=>"<line-height=130%>Es ist nur noch ein Schritt. Wir müssen nur noch das Strohseil und den Flaschenzug vorbereiten, bevor wir dich herausfischen können."],
13756=>["Value"=>13756,"TextKey"=>"剧情ID2030774","TextValue"=>"<line-height=130%>Ich spüre, dass du es auf mich abgesehen hast...... *Tränen in den Augen*"],
13757=>["Value"=>13757,"TextKey"=>"剧情ID2040101","TextValue"=>"<line-height=130%>Mein Häuptling, bist du schon mit dem Sammeln der Materialien fertig? Es ist okay, sich Zeit zu lassen, denn seit Edna nicht mehr hier ist, können wir endlich etwas Ruhe haben..."],
13758=>["Value"=>13758,"TextKey"=>"剧情ID2040102","TextValue"=>"<line-height=130%>Ich kann dich immer noch hören! Das ist nicht in Ordnung!"],
13759=>["Value"=>13759,"TextKey"=>"剧情ID2040103","TextValue"=>"<line-height=130%>Huch! Wusste nicht, dass sie hören kann... Aha, der Flaschenzug ist fertig!"],
13760=>["Value"=>13760,"TextKey"=>"剧情ID2040201","TextValue"=>"<line-height=130%>Lieber Priester, das Rettungsteam ist unten, bitte mach dich sichtbar, damit du nicht zertreten wirst..."],
13761=>["Value"=>13761,"TextKey"=>"剧情ID2040202","TextValue"=>"<line-height=130%>Du stehst auf mir! Geh runter von mir! "],
13762=>["Value"=>13762,"TextKey"=>"剧情ID2040203","TextValue"=>"<line-height=130%>Es sieht so aus, als ob der Priester bald oben sein wird, vielen Dank, Ma'am."],
13763=>["Value"=>13763,"TextKey"=>"剧情ID2040204","TextValue"=>"<line-height=130%>Nicht Ma'am, ich heiße Tlachtga. Mal sehen, wo habe ich dich gerade erwischt?"],
13764=>["Value"=>13764,"TextKey"=>"剧情ID2040205","TextValue"=>"<line-height=130%>Sie haben mich am Schienbein erwischt, Ma'am, nein, Tlachtga."],
13765=>["Value"=>13765,"TextKey"=>"剧情ID2040206","TextValue"=>"<line-height=130%>Hab dich. Jäger wie ich sind Profis im Versorgen von Wunden. Ich habe einen Beutel mit Sukkulentenblättern da unten in der Mine. Ich habe sie als Vorrat benutzt. Lass uns ein paar davon pflanzen und dein süßes Beinchen mit dem Saft einreiben!"],
13766=>["Value"=>13766,"TextKey"=>"剧情ID2040207","TextValue"=>"<line-height=130%>Äh... kleines Beinchen... okay. Sollen wir jetzt da runter gehen? "],
13767=>["Value"=>13767,"TextKey"=>"剧情ID2040208","TextValue"=>"Nein, nein, nein, ihr kleinen Schwächlinge werdet Fackeln brauchen, um da unten zu sehen. Es ist viel tiefer als ihr denkt. Geht Fackeln und Grabungswerkzeuge suchen!"],
13768=>["Value"=>13768,"TextKey"=>"剧情ID2050101","TextValue"=>"<line-height=130%>Halt das, wenn das Feuer ausgeht, bleibst du stehen und kehrst um, ok?"],
13769=>["Value"=>13769,"TextKey"=>"剧情ID2050102","TextValue"=>"<line-height=130%>Fertig? Los geht's! Achte auf deine Schritte!"],
13770=>["Value"=>13770,"TextKey"=>"剧情ID2050103","TextValue"=>"<line-height=130%>Ja, Ma'am!"],
13771=>["Value"=>13771,"TextKey"=>"剧情ID2050104","TextValue"=>"Häuptling, danke, dass du hier oben bei Priest und mir geblieben bist. Ich bin ziemlich traurig, dass ich nicht mitgehen kann, aber Tlachtga hat gesagt, ich sollte besser hier oben bleiben, wenn ich mein Bein nicht verlieren will. Ich kann es kaum erwarten, was sie uns bringen können!"],
13772=>["Value"=>13772,"TextKey"=>"剧情ID2050105","TextValue"=>"<line-height=130%>Ich kann nicht glauben, dass die Große Tlachtga dich sie einfach beim Namen nennen lässt. Was für eine Ehre! Und du zeigst nicht ein bisschen Dankbarkeit..."],
13773=>["Value"=>13773,"TextKey"=>"剧情ID2050201","TextValue"=>"<line-height=130%>Oh mein Herr, was ist das?"],
13774=>["Value"=>13774,"TextKey"=>"剧情ID2050202","TextValue"=>"<line-height=130%>Das ist ein unterirdischer Fluss! Ich kann nicht glauben, dass unser Team einen <color=#f58c26>unterirdischen Fluss</color> gefunden hat! Jetzt haben wir Wasser!"],
13775=>["Value"=>13775,"TextKey"=>"剧情ID2050203","TextValue"=>"<line-height=130%>Und durchnässt."],
13776=>["Value"=>13776,"TextKey"=>"剧情ID2050204","TextValue"=>"<line-height=130%>Nun reiß dich zusammen, du Weichei! Es ist doch nur ein bisschen Wasser! "],
13777=>["Value"=>13777,"TextKey"=>"剧情ID2050205","TextValue"=>"Hey du, Häuptling, jetzt wo du Wasser hast, können wir ein paar Sukkulenten pflanzen! Das Blatt einer Sukkulente, ein paar Gesänge und die richtige Pflege, und schon hast du eine pralle Sukkulente!"],
13778=>["Value"=>13778,"TextKey"=>"剧情ID2050206","TextValue"=>"<line-height=130%>Diese Damen gehören dir, geh und lass sie ein paar Eimer, Schaufeln und Dünger suchen. Ich werde genau hier warten."],
13779=>["Value"=>13779,"TextKey"=>"剧情ID2060101","TextValue"=>"<line-height=130%>In Ordnung! Fertig, sieh mal, wie süß das ist! Nimm dir ein Stück, ein großes Stück."],
13780=>["Value"=>13780,"TextKey"=>"剧情ID2060102","TextValue"=>"<line-height=130%>Ich habe diese Art von Pflanze noch nie gesehen... Was? Nimm ein Stück, sagst du?"],
13781=>["Value"=>13781,"TextKey"=>"剧情ID2060103","TextValue"=>"<line-height=130%>Ja, nimm ein Blatt, presse den Saft aus und reibe es auf deine verletzte Haut."],
13782=>["Value"=>13782,"TextKey"=>"剧情ID2060104","TextValue"=>"<line-height=130%>Okay... Nimm ein Stück... Reib... Wow, es hat tatsächlich funktioniert! Ich habe noch nie von einem Kraut gehört, das Wunden so schnell heilen kann!"],
13783=>["Value"=>13783,"TextKey"=>"剧情ID2060105","TextValue"=>"Die Leute nennen mich die Mutter aller Länder, um es mal so zu sagen. Ich nehme an, der Name kommt von meinem extrem beeindruckenden grünen Daumen. Dies sind keine gewöhnlichen Sukkulentenpflanzen. Ich habe sie selbst gezüchtet."],
13784=>["Value"=>13784,"TextKey"=>"剧情ID2060106","TextValue"=>"<line-height=130%>Wundertäter! Ah! Jetzt habe ich das Gefühl, dass wir das Geheimnis unseres Hauses im Handumdrehen lösen können! "],
13785=>["Value"=>13785,"TextKey"=>"剧情ID2060107","TextValue"=>"Was das angeht, muss ich jetzt wirklich ein Nickerchen machen, da meine Energie verbraucht ist. Was dagegen, wenn ich in deinem "Zuhause" ein Nickerchen mache? Ist es ein Basislager? Habt ihr ein Bett?"],
13786=>["Value"=>13786,"TextKey"=>"剧情ID2060108","TextValue"=>"Ja, es ist eine Art Basislager, und hier ist die Karte, die wir für den Rückweg gemacht haben. Aber... planst du nur eine Übernachtung oder kommst du mit uns?"],
13787=>["Value"=>13787,"TextKey"=>"剧情ID2060109","TextValue"=>"<line-height=130%>Natürlich schließe ich mich euch an! Bist du bescheuert?! Du brauchst Hilfe, ich habe nichts zu tun, also warum nicht? Wir sind wahrscheinlich sowieso hinter der gleichen Person her. Also! Ich nehme die Karte mit, wir sehen uns!"],
13788=>["Value"=>13788,"TextKey"=>"剧情ID2060201","TextValue"=>"Und schon ist sie weg. Ich habe das Gefühl, dass sie eine gute Freundin für unser Volk sein wird. Dann lasst uns unser Lager fertig bauen. Genau wie bei unserem früheren Lager brauchen wir ein <color=#f58c26>Lagerhaus</color>, um die Materialien zu lagern."],
13789=>["Value"=>13789,"TextKey"=>"剧情ID2060202","TextValue"=>"<line-height=130%>Lasst uns ein paar Materialien für das <color=#f58c26>Lagerhaus</color> sammeln!"],
13790=>["Value"=>13790,"TextKey"=>"剧情ID2070101","TextValue"=>"<line-height=130%>Gute Arbeit! "],
13791=>["Value"=>13791,"TextKey"=>"剧情ID2070102","TextValue"=>"<line-height=130%>Du hast dich noch nicht dafür bedankt, dass ich dich zum Wasser geführt habe! Ich sagte doch, dass ich mit diesem Ort recht habe!"],
13792=>["Value"=>13792,"TextKey"=>"剧情ID2070103","TextValue"=>"<line-height=130%>Schon gut, schon gut. Ich werde deine Wahrsagerei in Zukunft voll und ganz respektieren und jede einzelne deiner unvernünftigen Bitten erfüllen. Was brauchst du nun als nächstes?"],
13793=>["Value"=>13793,"TextKey"=>"剧情ID2070104","TextValue"=>"<line-height=130%>Du...! Vergiss es. Ich muss wieder mit Gott sprechen, um zu wissen, wohin wir als nächstes gehen sollen. Dieses Mal brauche ich einen <color=#f58c26>Wachturm</color>, um Astrologie auszuprobieren. "],
13794=>["Value"=>13794,"TextKey"=>"剧情ID2070105","TextValue"=>"<line-height=130%>Warum Astrologie? Wir sind uns nicht einmal sicher, was diese Sterne sind, ich meine, es sind doch nur leuchtende Punkte am Himmel!"],
13795=>["Value"=>13795,"TextKey"=>"剧情ID2070106","TextValue"=>"<line-height=130%>Wir haben keine Zeit mehr! Wir haben tonnenweise Arbeit zu erledigen! Hör auf mit deinem dummen Unsinn!"],
13796=>["Value"=>13796,"TextKey"=>"剧情ID2070107","TextValue"=>"<line-height=130%>Geh und hol die Sachen, die wir brauchen, und sei so schnell wie möglich zurück!"],
13797=>["Value"=>13797,"TextKey"=>"剧情ID2070108","TextValue"=>"<line-height=130%>Also gut..."],
13798=>["Value"=>13798,"TextKey"=>"剧情ID2070201","TextValue"=>"<line-height=130%>Die Erwachsenen haben mir gesagt, ich soll mich nicht mit den Ältesten anlegen, warum habe ich nie zugehört..."],
13799=>["Value"=>13799,"TextKey"=>"剧情ID2080101","TextValue"=>"<line-height=130%>Ok mein Häuptling, du hast dein Werk vollbracht, und das Einzige was noch übrig ist, ist der <color=#f58c26>Wachturm</color>, den der Priester mich gebeten hat zu bauen...."],
13800=>["Value"=>13800,"TextKey"=>"剧情ID2080102","TextValue"=>"<line-height=130%>Ich kann dich hören, du Penner! Hör auf zu jammern und mach deine Arbeit!"],
13801=>["Value"=>13801,"TextKey"=>"剧情ID2080103","TextValue"=>"<line-height=130%>Okay, okay, *seufz*"],
13802=>["Value"=>13802,"TextKey"=>"剧情ID2080201","TextValue"=>"<line-height=130%>Ok mein Häuptling, ich werde jetzt zu den Göttern sprechen."],
13803=>["Value"=>13803,"TextKey"=>"剧情ID2080202","TextValue"=>"<line-height=130%>Du kannst dich eine Sekunde ausruhen, wir sehen uns gleich."],
13804=>["Value"=>13804,"TextKey"=>"剧情ID2080203","TextValue"=>"<line-height=130%>*Flüster* Hier drüben, Häuptling, hier drüben..."],
13805=>["Value"=>13805,"TextKey"=>"剧情ID2080204","TextValue"=>"<line-height=130%>Edna kann endlich für einen Moment innehalten."],
13806=>["Value"=>13806,"TextKey"=>"剧情ID2080205","TextValue"=>"<line-height=130%>Unser Team hat dort unten in der Mine einen Haufen Gold und Wilderz gefunden."],
13807=>["Value"=>13807,"TextKey"=>"剧情ID2080206","TextValue"=>"<line-height=130%>Wir überlegen, eine Truhe zu bauen, um sie hierher zu transportieren, deshalb sind wir hier und bitten um eure Hilfe."],
13808=>["Value"=>13808,"TextKey"=>"剧情ID2080207","TextValue"=>"<line-height=130%>Könntet ihr ein paar Materialien für den Bau dieser Truhe sammeln?"],
13809=>["Value"=>13809,"TextKey"=>"剧情ID2090101","TextValue"=>"<line-height=130%>Uff, das war eine Menge Gold. "],
13810=>["Value"=>13810,"TextKey"=>"剧情ID2090102","TextValue"=>"<line-height=130%>Was ist das? Es leuchtet..."],
13811=>["Value"=>13811,"TextKey"=>"剧情ID2090201","TextValue"=>"<line-height=130%>Es ist ein kleines Päckchen... auf dem steht "Iss mich". Und darin ist ein <color=#f58c26>leuchtender Samen</color>? Bedeutet das, dass du den Samen essen sollst?"],
13812=>["Value"=>13812,"TextKey"=>"剧情ID2090202","TextValue"=>"<line-height=130%>Überlass das mir!"],
13813=>["Value"=>13813,"TextKey"=>"剧情ID2090203","TextValue"=>"<line-height=130%>Was?! Priester, was machst du da?!"],
13814=>["Value"=>13814,"TextKey"=>"剧情ID2090301","TextValue"=>"<line-height=130%>Hast du es gerade gegessen?! Wir haben noch nicht herausgefunden, was es ist!"],
13815=>["Value"=>13815,"TextKey"=>"剧情ID2090302","TextValue"=>"Das Muster der Sterne hat sich so ausgerichtet, dass es auf den <color=#f58c26>Großen Canyan</color> im <color=#f58c26>Südosten</color> hinweist, und der <color=#f58c26>sedierende Samen</color> wird mir helfen, den... *schnarch*"],
13816=>["Value"=>13816,"TextKey"=>"剧情ID2090303","TextValue"=>"<line-height=130%>Priester? Priester? Bist du noch da?"],
13817=>["Value"=>13817,"TextKey"=>"剧情ID2090304","TextValue"=>"<line-height=130%>*Schnarch*"],
13818=>["Value"=>13818,"TextKey"=>"剧情ID2090305","TextValue"=>"<line-height=130%>Und sie schlief ein. Ich verstehe diese Leute mit geheimnisvollen Kräften nicht ganz. Sie scheinen manchmal so seltsam zu sein. "],
13819=>["Value"=>13819,"TextKey"=>"剧情ID2090306","TextValue"=>"<line-height=130%>Uuuh, wohin sollen wir denn jetzt gehen, nachdem der Priester ohnmächtig geworden ist?"],
13820=>["Value"=>13820,"TextKey"=>"剧情ID2090307","TextValue"=>"<line-height=130%>Sie sagte der <color=#f58c26>Große Canyon</color>, richtig? Ganz im <color=#f58c26>Süden</color>?"],
13821=>["Value"=>13821,"TextKey"=>"剧情ID2090308","TextValue"=>"<line-height=130%>Sollten wir ihr trauen? Sie scheint ein wenig... nicht sie selbst zu sein im Moment?"],
13822=>["Value"=>13822,"TextKey"=>"剧情ID2090309","TextValue"=>"Ja, ich habe versprochen, dass ich ihr in Zukunft vertrauen werde. Außerdem, wo können wir als nächstes hingehen? Lasst uns für heute ausruhen und morgen nach Südosten aufbrechen."],
13823=>["Value"=>13823,"TextKey"=>"剧情ID3010101","TextValue"=>"<line-height=130%>Hey du!"],
13824=>["Value"=>13824,"TextKey"=>"剧情ID3010102","TextValue"=>"Ja?"],
13825=>["Value"=>13825,"TextKey"=>"剧情ID3010103","TextValue"=>"Ja! Du. Würde es dir etwas ausmachen, einer alten Dame zu helfen?"],
13826=>["Value"=>13826,"TextKey"=>"剧情ID3010104","TextValue"=>"Ähm... ich bin nicht wirklich hier."],
13827=>["Value"=>13827,"TextKey"=>"剧情ID3010105","TextValue"=>"Hm, und warum ist das so?"],
13828=>["Value"=>13828,"TextKey"=>"剧情ID3010106","TextValue"=>"Ich bin gerade mit den Leuten meines Stammes unterwegs. Wir sind auf einer Reise auf der Suche nach Helden, die uns helfen können, das Geheimnis unserer Heimat zu lösen."],
13829=>["Value"=>13829,"TextKey"=>"剧情ID3010107","TextValue"=>"Ich verstehe. Ich spreche eigentlich mit dir, der du diesen kleinen leuchtenden Block hältst?"],
13830=>["Value"=>13830,"TextKey"=>"剧情ID3010108","TextValue"=>"Mein... <color=#f58c26>Telefon</color>?"],
13831=>["Value"=>13831,"TextKey"=>"剧情ID3010109","TextValue"=>"Ja genau. Das <color=#f58c26>"Mein Telefon"</color>. Würdest du mir helfen?"],
13832=>["Value"=>13832,"TextKey"=>"剧情ID3010110","TextValue"=>"Warte... Warum kannst du mich *riechen*?"],
13833=>["Value"=>13833,"TextKey"=>"剧情ID3010111","TextValue"=>"Hach, obwohl ich ein blindes Auge habe, kann ich trotzdem alles wahrnehmen. Du wirst es später verstehen. Würdest du mir jetzt helfen?"],
13834=>["Value"=>13834,"TextKey"=>"剧情ID3010112","TextValue"=>"Ok. Was brauchst du?"],
13835=>["Value"=>13835,"TextKey"=>"剧情ID3010113","TextValue"=>"Dein Stamm wird doch vorbeikommen, oder? Ich tue so, als bräuchte ich dringend Nahrung, und baue einen <color=#f58c26>Winzigen Stand</color> auf, um meinen Müll zu verkaufen? OMG, ein großartiger Plan!"],
13836=>["Value"=>13836,"TextKey"=>"剧情ID3010114","TextValue"=>"Ich versteh's nicht..."],
13837=>["Value"=>13837,"TextKey"=>"剧情ID3010115","TextValue"=>"Ich will doch nicht irgendwelchen unhöflichen Leuten helfen, oder? Du musst nett sein, um meine Hilfe zu bekommen."],
13838=>["Value"=>13838,"TextKey"=>"剧情ID3010116","TextValue"=>"Na und?"],
13839=>["Value"=>13839,"TextKey"=>"剧情ID3010117","TextValue"=>"Wenn sie meine Sachen kaufen und mir Essen geben, ist es okay. Oder mir direkt Essen geben, noch besser!"],
13840=>["Value"=>13840,"TextKey"=>"剧情ID3010118","TextValue"=>"Sonst? Ein Fingerschnippen und dein Stamm wird nicht mehr sein. Kapiert? Dann geh und sammle ein paar Materialien für mich!"],
13841=>["Value"=>13841,"TextKey"=>"剧情ID3020101","TextValue"=>"Unglaublich! Ich danke euch allen so sehr! "],
13842=>["Value"=>13842,"TextKey"=>"剧情ID3020102","TextValue"=>"Ich hoffe, meine Tochter ist genauso zuverlässig und effizient wie du. "],
13843=>["Value"=>13843,"TextKey"=>"剧情ID3020103","TextValue"=>"Wir wurden vorhin in der Wüste getrennt, und ich habe mich verlaufen... Mein Orientierungssinn ist nicht so toll. "],
13844=>["Value"=>13844,"TextKey"=>"剧情ID3020104","TextValue"=>"Weißt du, wo sie jetzt ist?"],
13845=>["Value"=>13845,"TextKey"=>"剧情ID3020105","TextValue"=>"Natürlich weiß ich, wo sie ist! Aber sie kann doch nicht einfach... nicht nach mir suchen! "],
13846=>["Value"=>13846,"TextKey"=>"剧情ID3020201","TextValue"=>"Das fühlt sich gut an. Verstehst du? Nur du und ich, chillen, ein bisschen plaudern, etwas Tee verschütten..."],
13847=>["Value"=>13847,"TextKey"=>"剧情ID3020301","TextValue"=>"Sie werden kommen. Wir müssen nur noch warten."],
13848=>["Value"=>13848,"TextKey"=>"剧情ID3020302","TextValue"=>"......"],
13849=>["Value"=>13849,"TextKey"=>"剧情ID3020303","TextValue"=>"Eine lange Zeit ist vergangen."],
13850=>["Value"=>13850,"TextKey"=>"剧情ID3020304","TextValue"=>"Ich werde auf die Knochen klettern und nachsehen, wo sie sind."],
13851=>["Value"=>13851,"TextKey"=>"剧情ID3020401","TextValue"=>"Ha! Sie sind da! Deine kleinen Priester sind unwiderstehlich süß!"],
13852=>["Value"=>13852,"TextKey"=>"剧情ID3020402","TextValue"=>"In Ordnung, sie werden in kürzester Zeit hier sein. Ich kann es nicht erwarten, deine Leute zu treffen! Jetzt muss ich nur noch vorsichtig runter kommen..."],
13853=>["Value"=>13853,"TextKey"=>"剧情ID3020501","TextValue"=>"Ist alles in Ordnung mit dir?"],
13854=>["Value"=>13854,"TextKey"=>"剧情ID3020502","TextValue"=>"Hallo?"],
13855=>["Value"=>13855,"TextKey"=>"剧情ID3020601","TextValue"=>"Einen Moment später"],
13856=>["Value"=>13856,"TextKey"=>"剧情ID3020701","TextValue"=>""Ich verhungere, bitte kaufe ein, gib mir bitte etwas zu essen." Hm. Sieht aus, als hätte hier jemand ein kleines Geschäft gestartet."],
13857=>["Value"=>13857,"TextKey"=>"剧情ID3020702","TextValue"=>"Ah Häuptling, da bist du ja. Priester Edna sagte, dass jemand aus seinem Traum hier auf uns wartet. "],
13858=>["Value"=>13858,"TextKey"=>"剧情ID3020703","TextValue"=>"Ich sehe hier ein paar Spuren menschlicher Aktivität, aber dieses Lagerfeuer ist erloschen, dieser winzige Stand ist kurz davor zusammenzubrechen und ich sehe niemanden in der Nähe... Wurden wir sitzengelassen?"],
13859=>["Value"=>13859,"TextKey"=>"剧情ID3020704","TextValue"=>"Wie auch immer, lass uns ein Lager bauen und die Nacht hier verbringen, und darauf warten, dass diese "Person aus dem Traum" auftaucht."],
13860=>["Value"=>13860,"TextKey"=>"剧情ID3020801","TextValue"=>"Ich bin so ausgebrannt... Endlich... dieser Mantel fühlt sich an wie ein Ofen! Ich werde geröstet! Zieh ihn aus!!"],
13861=>["Value"=>13861,"TextKey"=>"剧情ID3020802","TextValue"=>"Lieber Priester, du hast gerade fest auf dem Rücken eines Kamels geschlafen. Du darfst nicht "ausgebrannt" sagen."],
13862=>["Value"=>13862,"TextKey"=>"剧情ID3020803","TextValue"=>"Übrigens, du kannst deinen Mantel auch nicht ausziehen. Auch wenn es im Moment so heiß wie in der Hölle ist, frierst du nachts immer noch."],
13863=>["Value"=>13863,"TextKey"=>"剧情ID3020804","TextValue"=>"Lieber Gott... Warum bringst du mich hierher... und musst dich auch noch mit diesem arroganten jungen Kerl abgeben..."],
13864=>["Value"=>13864,"TextKey"=>"剧情ID3020805","TextValue"=>"Bitte hab ein wenig mehr Geduld. Der Häuptling wird hier die Materialien sammeln, die wir für den Bau eines <color=#f58c26>Zeltes</color> benötigen."],
13865=>["Value"=>13865,"TextKey"=>"剧情ID3030101","TextValue"=>"Gut gemacht Häuptling! Lasst uns loslegen!"],
13866=>["Value"=>13866,"TextKey"=>"剧情ID3030201","TextValue"=>"Großartig! Ich glaube, die Leute sind inzwischen alle hungrig. Lasst uns das Lagerfeuer voll ausnutzen und etwas kochen. Esst gut, arbeitet gut!"],
13867=>["Value"=>13867,"TextKey"=>"剧情ID3030202","TextValue"=>"Hurra! Essen! Speck!"],
13868=>["Value"=>13868,"TextKey"=>"剧情ID3030203","TextValue"=>"Lammkotelett für mich bitte..."],
13869=>["Value"=>13869,"TextKey"=>"剧情ID3030204","TextValue"=>"Du wilder Fleischfresser!"],
13870=>["Value"=>13870,"TextKey"=>"剧情ID3030205","TextValue"=>"Also was willst du?"],
13871=>["Value"=>13871,"TextKey"=>"剧情ID3030206","TextValue"=>"Steak, medium mit Meerrettichsauce bitte."],
13872=>["Value"=>13872,"TextKey"=>"剧情ID3030207","TextValue"=>"Priester, das ist also..."],
13873=>["Value"=>13873,"TextKey"=>"剧情ID3030208","TextValue"=>"Ich weiß! Pssst!"],
13874=>["Value"=>13874,"TextKey"=>"剧情ID3030209","TextValue"=>"Haha, Eiweiß ist sehr wichtig für einen reisenden Körper. Es war ein harter Ritt, also lasst uns schlemmen! Was sagst du, Häuptling?"],
13875=>["Value"=>13875,"TextKey"=>"剧情ID3030210","TextValue"=>"Wir haben nicht so viel Material zum Kochen..."],
13876=>["Value"=>13876,"TextKey"=>"剧情ID3030211","TextValue"=>"Wir haben Hammel, getrocknetes Rindfleisch und Äpfel, Häuptling!"],
13877=>["Value"=>13877,"TextKey"=>"剧情ID3030212","TextValue"=>"Aber Häuptling hat recht, wir wollen noch etwas davon für spätere härtere Nächte aufheben. Also müssen wir ein paar alternative Proteine finden."],
13878=>["Value"=>13878,"TextKey"=>"剧情ID3030213","TextValue"=>"Ich habe ein paar Wüsteneidechsen gesichtet. Eidechseneier und sie selbst wären großartige Eiweißquellen!"],
13879=>["Value"=>13879,"TextKey"=>"剧情ID3030214","TextValue"=>"Was hast du gesagt?! Eidechsen?! Wie können wir Eidechsen essen?!"],
13880=>["Value"=>13880,"TextKey"=>"剧情ID3030215","TextValue"=>"Es gibt alle möglichen Köstlichkeiten, die wir kreieren können, wenn wir unseren Geist öffnen! "Eidechseneintopf" klingt zum Beispiel besonders verlockend!"],
13881=>["Value"=>13881,"TextKey"=>"剧情ID3030216","TextValue"=>"Ich kann es kaum erwarten!"],
13882=>["Value"=>13882,"TextKey"=>"剧情ID3030217","TextValue"=>"Oh... Eidechsenjagd..."],
13883=>["Value"=>13883,"TextKey"=>"剧情ID3040101","TextValue"=>"Unglaublich! Du hast alle Materialien gesammelt! Lasst uns loslegen!"],
13884=>["Value"=>13884,"TextKey"=>"剧情ID3040102","TextValue"=>"Ich komme! Zündet das Lagerfeuer an!"],
13885=>["Value"=>13885,"TextKey"=>"剧情ID3040201","TextValue"=>"Endlich... Essen... ich kann mich nicht mehr bewegen Spiegeleier, Steak, Bratäpfel..."],
13886=>["Value"=>13886,"TextKey"=>"剧情ID3040202","TextValue"=>"Hammelkotelett für Arlan, und Spiegelei für Kevin... Und Priest Edna wird diese Schüssel mit leckerem Echseneintopf mit mir teilen..."],
13887=>["Value"=>13887,"TextKey"=>"剧情ID3040301","TextValue"=>"Niemand teilt den Eidechseneintopf!"],
13888=>["Value"=>13888,"TextKey"=>"剧情ID3040302","TextValue"=>"Nun, ich denke, dann werde ich diese Schüssel mit warmem, dampfendem, leckerem Eintopf unseren neuen Freunden geben."],
13889=>["Value"=>13889,"TextKey"=>"剧情ID3040303","TextValue"=>"Neue Freunde? Was für neue Freunde?"],
13890=>["Value"=>13890,"TextKey"=>"剧情ID3040401","TextValue"=>"Ah!!! Neiiiin!!! Weg mit diesen Ratten!!!"],
13891=>["Value"=>13891,"TextKey"=>"剧情ID3040402","TextValue"=>"Zunächst einmal sind es keine Ratten. Ratten können nicht so groß sein. Meiner Beobachtung nach sind das Maubbits, eine Nagetierart, die nur in trockenen Regionen vorkommt."],
13892=>["Value"=>13892,"TextKey"=>"剧情ID3040403","TextValue"=>"Außerdem sind sie erstaunlich scheu, wenn man ihre beeindruckende Größe bedenkt. Ich versichere dir also, dass diese sanften Kreaturen völlig harmlos gegenüber Menschen sind."],
13893=>["Value"=>13893,"TextKey"=>"剧情ID3040404","TextValue"=>"Ok ok, ich weiß!!! Es ist mir egal, was sie sind! Nimm sie weg von mir!!"],
13894=>["Value"=>13894,"TextKey"=>"剧情ID3040405","TextValue"=>"Hmm... jetzt, wo du es erwähnst, ist es eigentlich ziemlich seltsam, dass sie überhaupt keine Angst vor dir haben..."],
13895=>["Value"=>13895,"TextKey"=>"剧情ID3040406","TextValue"=>"Liebe Arbeiter, würdet ihr so freundlich sein und diese lieblichen Kreaturen von unserem Priester entfernen?"],
13896=>["Value"=>13896,"TextKey"=>"剧情ID3040407","TextValue"=>"Aye!"],
13897=>["Value"=>13897,"TextKey"=>"剧情ID3040501","TextValue"=>"Hey! Gebt sie zurück!"],
13898=>["Value"=>13898,"TextKey"=>"剧情ID3040502","TextValue"=>"Hmm, und schon sind sie weg. Es scheint, dass sie immer noch Angst vor allen haben, außer vor dem Priester."],
13899=>["Value"=>13899,"TextKey"=>"剧情ID3040503","TextValue"=>"Sie haben meinen Ring genommen! Meinen geliebten Ring..."],
13900=>["Value"=>13900,"TextKey"=>"剧情ID3040504","TextValue"=>"Armer Priester, ich schätze, wir können ihren Schritten in die Drachenreste folgen? Ich bin sowieso ziemlich neugierig auf diese kleinen Kerle. "],
13901=>["Value"=>13901,"TextKey"=>"剧情ID3040505","TextValue"=>"Und dafür brauchen wir eine <color=#f58c26>Windmühle</color>, die uns hilft, die Leute hoch und runter zu transportieren, wenn man bedenkt, wie steil dieser Berg ist."],
13902=>["Value"=>13902,"TextKey"=>"剧情ID3050101","TextValue"=>"Sind wir mit den Materialien für die <color=#f58c26>Windmühle</color> schon so weit? Beeindruckend!"],
13903=>["Value"=>13903,"TextKey"=>"剧情ID3050102","TextValue"=>"Die neue Windmühle kommt sofort!"],
13904=>["Value"=>13904,"TextKey"=>"剧情ID3050201","TextValue"=>"Geil! Jetzt ist es viel sicherer und bequemer, den Hang rauf und runter zu fahren!"],
13905=>["Value"=>13905,"TextKey"=>"剧情ID3050202","TextValue"=>"Super! Beeil dich und bring meinen Ring zurück! Das Ding ist heilig!"],
13906=>["Value"=>13906,"TextKey"=>"剧情ID3050203","TextValue"=>"Ok ok, wir gehen! Kevin, Arlan, seid ihr bereit?"],
13907=>["Value"=>13907,"TextKey"=>"剧情ID3050204","TextValue"=>"Wie immer!"],
13908=>["Value"=>13908,"TextKey"=>"剧情ID3050205","TextValue"=>"Ähm... ich bin ja kein Feigling, aber ich denke, wir brauchen immer noch Seile, nur für den Fall, dass wir von der Klippe fallen..."],
13909=>["Value"=>13909,"TextKey"=>"剧情ID3050206","TextValue"=>"Aha, du hast absolut Recht! Arbeitssicherheit ist wichtig! Also Häuptling, geh und besorg dir eine Sicherheitsausrüstung!"],
13910=>["Value"=>13910,"TextKey"=>"剧情ID3060101","TextValue"=>"Sind wir jetzt bereit?"],
13911=>["Value"=>13911,"TextKey"=>"剧情ID3060102","TextValue"=>"Ja!"],
13912=>["Value"=>13912,"TextKey"=>"剧情ID3060103","TextValue"=>"Wunderbar! Lass uns jetzt das Geheimnis der Maubbits lösen! Wie aufregend!"],
13913=>["Value"=>13913,"TextKey"=>"剧情ID3060104","TextValue"=>"Und meinen Ring zurückholen!"],
13914=>["Value"=>13914,"TextKey"=>"剧情ID3060201","TextValue"=>"Wow, das ist ein wirklich tiefer Knochenhaufen! Warte... da ist ein funkelndes Ding am Boden... Hmm... Kann das Ednas Ring sein?"],
13915=>["Value"=>13915,"TextKey"=>"剧情ID3060202","TextValue"=>"Chef! Schau, was wir gefunden haben! Eine alte Frau, die mit Dreck bedeckt ist!"],
13916=>["Value"=>13916,"TextKey"=>"剧情ID3060203","TextValue"=>"Und den Ring des Priesters."],
13917=>["Value"=>13917,"TextKey"=>"剧情ID3060301","TextValue"=>"*Tränen* Danke, Arlan, der Vernünftigste von uns allen... Moment, was?"],
13918=>["Value"=>13918,"TextKey"=>"剧情ID3060401","TextValue"=>"*Aufregende Geräusche*"],
13919=>["Value"=>13919,"TextKey"=>"剧情ID3060402","TextValue"=>"Also... danke?"],
13920=>["Value"=>13920,"TextKey"=>"剧情ID3060403","TextValue"=>"*Glückliche Geräusche*"],
13921=>["Value"=>13921,"TextKey"=>"剧情ID3060501","TextValue"=>"*Aufregende Geräusche*"],
13922=>["Value"=>13922,"TextKey"=>"剧情ID3060502","TextValue"=>"Oh, hallo! Hallo! Du bist so einladend! Kenne ich dich? Dein Fell kommt mir irgendwie bekannt vor..."],
13923=>["Value"=>13923,"TextKey"=>"剧情ID3060503","TextValue"=>"Oh! Und du musst der kleine Priester in meinem Traum sein! In Wirklichkeit bist du sogar noch kleiner!"],
13924=>["Value"=>13924,"TextKey"=>"剧情ID3060504","TextValue"=>"Klein? Wie kannst du es wagen, mich klein zu nennen?! Ich bin der edle Bote Gottes..."],
13925=>["Value"=>13925,"TextKey"=>"剧情ID3060505","TextValue"=>"Entschuldigung, du sagtest, du hast von unserem Priester geträumt?"],
13926=>["Value"=>13926,"TextKey"=>"剧情ID3060506","TextValue"=>"Oh~ Junger Mann! Ja! Ich träumte davon, deinem kleinen Priester zu sagen: "Ich werde auf dich warten." Aber ich weiß gar nicht, was das bedeutet!"],
13927=>["Value"=>13927,"TextKey"=>"剧情ID3060507","TextValue"=>"Was meinst du mit "du weißt nicht, was das bedeutet"?"],
13928=>["Value"=>13928,"TextKey"=>"剧情ID3060508","TextValue"=>"Eigentlich ist das lustig. Ich kann mich überhaupt nicht an meinen Namen erinnern, also weiß ich auch nicht, was dieser seltsame Traum bedeutet. "],
13929=>["Value"=>13929,"TextKey"=>"剧情ID3060509","TextValue"=>"Ich muss mir den Kopf ganz schön angeschlagen haben, als ich in die Grube gefallen bin. Ich bin immer noch ein wenig wackelig, wenn ich gehe. Siehst du?"],
13930=>["Value"=>13930,"TextKey"=>"剧情ID3060510","TextValue"=>"Gehört dieser kleine Stand hier drüben dir? Da steht: "Hungrig, bitte kaufen Sie meine Sachen, bitte geben Sie Essen?""],
13931=>["Value"=>13931,"TextKey"=>"剧情ID3060511","TextValue"=>"In Anbetracht dessen, dass das, was auf diesem Stand geschrieben steht, mich genau beschreibt, und dass wir uns mitten in der Wüste befinden, ja, ich schätze, es ist meins."],
13932=>["Value"=>13932,"TextKey"=>"剧情ID3060512","TextValue"=>"Oh! Keine Sorge! Wir haben reichlich Essen dabei. Bitte genießt sie in unserem Zelt."],
13933=>["Value"=>13933,"TextKey"=>"剧情ID3060513","TextValue"=>"Das wäre der Hammer!"],
13934=>["Value"=>13934,"TextKey"=>"剧情ID3060514","TextValue"=>"Oh, eine Sache allerdings, ich rieche Speck, Bratapfel und...<color=#f58c26>einen drohenden Sturm</color> in der Luft. Ihr solltet besser vorbereitet sein. "],
13935=>["Value"=>13935,"TextKey"=>"剧情ID3060601","TextValue"=>"Und... weg ist sie. Also gut, Häuptling, ich bin sicher, du hast es schon gehört, der Wind ist stark und verrückt hier, lass mich sehen..."],
13936=>["Value"=>13936,"TextKey"=>"剧情ID3060602","TextValue"=>"Unser Zelt braucht eine Verstärkung oben, um es zu beschweren."],
13937=>["Value"=>13937,"TextKey"=>"剧情ID3060603","TextValue"=>"Warum müssen wir auf sie hören! Wir wissen nicht, woher sie kommt, und du glaubst, was sie sagt! "],
13938=>["Value"=>13938,"TextKey"=>"剧情ID3060604","TextValue"=>"Meine Vorhersagen..... Du hackst immer auf einem Fehler von mir herum und verspottest mich! Ich werde das wahre Gesicht dieser Frau aufdecken, warte nur ab!"],
13939=>["Value"=>13939,"TextKey"=>"剧情ID3060605","TextValue"=>"Ooooh, da wird jemand kompetitiv. Wie auch immer, Häuptling, ich habe die Liste der Materialien erstellt, die für <color=#f58c26>Verstärkung des Zeltes</color> benötigt werden, bitte sieh sie dir an."],
13940=>["Value"=>13940,"TextKey"=>"剧情ID3070101","TextValue"=>"Ähm, leckerer Tee."],
13941=>["Value"=>13941,"TextKey"=>"剧情ID3070102","TextValue"=>"Und dieser Keks ist auch ganz nett, schmilzt auf der Zunge. Obwohl er außen ein bisschen verbrannt ist. "],
13942=>["Value"=>13942,"TextKey"=>"剧情ID3070103","TextValue"=>"Nächstes Mal kannst du die Temperatur senken und ihn länger backen."],
13943=>["Value"=>13943,"TextKey"=>"剧情ID3070104","TextValue"=>"Warum macht sie einen Nachmittagstee?!"],
13944=>["Value"=>13944,"TextKey"=>"剧情ID3070105","TextValue"=>"Was ist mit ihr los?"],
13945=>["Value"=>13945,"TextKey"=>"剧情ID3070106","TextValue"=>"Und was soll dieser seltsame britische Akzent! Wir sind nicht einmal in der richtigen Epoche!"],
13946=>["Value"=>13946,"TextKey"=>"剧情ID3070107","TextValue"=>"Entspann dich, kleiner Priester. Alles wird gut werden. Du wirst es verstehen."],
13947=>["Value"=>13947,"TextKey"=>"剧情ID3070108","TextValue"=>"Nein! Nichts wird gut werden! Und ich werde nichts verstehen! Lieber Gott... Wo zum Teufel kommt diese Frau her..."],
13948=>["Value"=>13948,"TextKey"=>"剧情ID3070109","TextValue"=>"Da du so aufrichtig gefragt hast, werde ich dank des Nachmittagstees, den ich soeben genossen habe, ein wenig nostalgisch."],
13949=>["Value"=>13949,"TextKey"=>"剧情ID3070110","TextValue"=>"Ich glaube, ich habe einige meiner Erinnerungen wiedergefunden. Eigentlich, ich meine, ehrlich gesagt, es ist so..."],
13950=>["Value"=>13950,"TextKey"=>"剧情ID3070111","TextValue"=>"Was ist das?"],
13951=>["Value"=>13951,"TextKey"=>"剧情ID3070112","TextValue"=>"Kannst du auch den <color=#f58c26>Winzigen Stand</color> draußen für mich verstärken?"],
13952=>["Value"=>13952,"TextKey"=>"剧情ID3070113","TextValue"=>"Was?!"],
13953=>["Value"=>13953,"TextKey"=>"剧情ID3070114","TextValue"=>"Das schlaksige alte Ich, das tagelang alleine gelaufen ist und diesen Stand aufgebaut hat, während es hungerte... Oh, so eine arme Frau!"],
13954=>["Value"=>13954,"TextKey"=>"剧情ID3070115","TextValue"=>"Also, wenn der Stand zusammenbricht, werde ich unglaublich traurig sein. Mein Schicksal liegt auf deinen Schultern! Ich bin dir unendlich dankbar!"],
13955=>["Value"=>13955,"TextKey"=>"剧情ID3070116","TextValue"=>"Was für eine interessante Dame."],
13956=>["Value"=>13956,"TextKey"=>"剧情ID3070117","TextValue"=>"Entschuldigung, was hast du gesagt?!"],
13957=>["Value"=>13957,"TextKey"=>"剧情ID3070118","TextValue"=>"Häuptling, ich habe die Materialliste für dich gemacht, bitte geh nachsehen."],
13958=>["Value"=>13958,"TextKey"=>"剧情ID3070119","TextValue"=>"Ignorier mich nicht!! Meine Güte, ich halte das nicht mehr aus!"],
13959=>["Value"=>13959,"TextKey"=>"剧情ID3080101","TextValue"=>"Wunderschön! Ihr seid alle unglaublich!"],
13960=>["Value"=>13960,"TextKey"=>"剧情ID3080102","TextValue"=>"Mama! Ich wusste es! Ich wusste, dass du es bist!"],
13961=>["Value"=>13961,"TextKey"=>"剧情ID3080201","TextValue"=>"Großer Tlachtga, wie kommt es, dass du hier bist?!"],
13962=>["Value"=>13962,"TextKey"=>"剧情ID3080202","TextValue"=>"Und diese junge Dame ist?"],
13963=>["Value"=>13963,"TextKey"=>"剧情ID3080203","TextValue"=>"Tlachtga! Deine Tochter! Hör auf, dich dumm zu stellen! "],
13964=>["Value"=>13964,"TextKey"=>"剧情ID3080204","TextValue"=>"Der Bote hat mir erzählt, dass sie eine blinde alte Frau aus einem Knochenhaufen ausgegraben haben, sie hörte sich sehr nach dir an, also könnte ich genauso gut nachschauen kommen."],
13965=>["Value"=>13965,"TextKey"=>"剧情ID3080205","TextValue"=>"Ich bin nicht überrascht, dich hier zu sehen."],
13966=>["Value"=>13966,"TextKey"=>"剧情ID3080206","TextValue"=>"Die Mutter von Tlachtga... ich habe noch nie gehört, dass Tlachtga eine Mutter hat..."],
13967=>["Value"=>13967,"TextKey"=>"剧情ID3080207","TextValue"=>"Natürlich habe ich eine Mutter, du Dummkopf!"],
13968=>["Value"=>13968,"TextKey"=>"剧情ID3080208","TextValue"=>"Schön sprechen."],
13969=>["Value"=>13969,"TextKey"=>"剧情ID3080209","TextValue"=>"Wie auch immer, diese verrückte Dame hier ist Mug Ruith und steht direkt vor dir."],
13970=>["Value"=>13970,"TextKey"=>"剧情ID3080210","TextValue"=>"Nenn mich Meg."],
13971=>["Value"=>13971,"TextKey"=>"剧情ID3080211","TextValue"=>"Aber ich dachte Mug Ruith wäre ein Mann..."],
13972=>["Value"=>13972,"TextKey"=>"剧情ID3080212","TextValue"=>"Nun, meine Mutter kann im Märchen vieles sein. Sie hat ihre wahre Identität vor den Leuten versteckt, als ich klein war."],
13973=>["Value"=>13973,"TextKey"=>"剧情ID3080213","TextValue"=>"Denn weißt du, wer ist wahrscheinlicher ausgenutzt zu werden, als eine blinde Frau und ein Dreijähriger?"],
13974=>["Value"=>13974,"TextKey"=>"剧情ID3080214","TextValue"=>"Ich schätze, so hat sich die Geschichte verbreitet... eine allmächtige Druidin, die alles weiß, eine blinde Kriegerin, ein mächtiger Ritter..."],
13975=>["Value"=>13975,"TextKey"=>"剧情ID3080215","TextValue"=>"Während sie in Wirklichkeit nur eine blinde alte Frau mit einem seltsamen Sinn für Humor ist."],
13976=>["Value"=>13976,"TextKey"=>"剧情ID3080216","TextValue"=>"Mug Ruith ist eine Frau... und ich war unhöflich zu Mug Ruith... Oh... ich werde verdammt sein... ich bin eine Schande für den Titel des Priesters..."],
13977=>["Value"=>13977,"TextKey"=>"剧情ID3080217","TextValue"=>"Kleiner Priester, sei nicht so trübsinnig. Du wirst besser darin werden, nett zu sein. Ich vergebe dir dieses Mal, da du so süß bist!"],
13978=>["Value"=>13978,"TextKey"=>"剧情ID3080218","TextValue"=>"Du hast uns also ausgetrickst? Du hast dein Gedächtnis nicht verloren?"],
13979=>["Value"=>13979,"TextKey"=>"剧情ID3080219","TextValue"=>"Ja... das tut mir leid. Lange Reisen können langweilig sein, weißt du? Ich hatte nur etwas Spaß. "],
13980=>["Value"=>13980,"TextKey"=>"剧情ID3080220","TextValue"=>"Aber hey, schau dir das schöne Zelt und den schönen Stand an! Jetzt fängt es an, wie ein Lager auszusehen! Obwohl, irgendwas fehlt immer noch..."],
13981=>["Value"=>13981,"TextKey"=>"剧情ID3080221","TextValue"=>"Was fehlt noch?"],
13982=>["Value"=>13982,"TextKey"=>"剧情ID3080222","TextValue"=>"Lass mich mal sehen..."],
13983=>["Value"=>13983,"TextKey"=>"剧情ID3080301","TextValue"=>"Ein Tor! Du brauchst ein Tor, um den Eingang des Lagers zu markieren, und mit ein paar Lichtern wird es so fabelhaft aussehen wie immer!"],
13984=>["Value"=>13984,"TextKey"=>"剧情ID3080302","TextValue"=>"Wir werden deine bescheidensten Diener sein und das Tor bauen, Ma'am! Häuptling, reiß dich zusammen!"],
13985=>["Value"=>13985,"TextKey"=>"剧情ID3090101","TextValue"=>"Hast du alles? Prima! Mach dich auf den Weg, beweg dich!"],
13986=>["Value"=>13986,"TextKey"=>"剧情ID3090201","TextValue"=>"Oh! Wie belebend! Das ist das erste Bauprojekt das ich jemals geleitet habe..."],
13987=>["Value"=>13987,"TextKey"=>"剧情ID3090202","TextValue"=>"Herzlichen Glückwunsch, Priest, du bist so sehr gewachsen. Aber ich weiß nicht, ob Meg damit zufrieden ist, wie unser Lager jetzt aussieht?"],
13988=>["Value"=>13988,"TextKey"=>"剧情ID3090203","TextValue"=>"Alles andere ist gut, aber der leere Himmel sieht ziemlich öde aus..."],
13989=>["Value"=>13989,"TextKey"=>"剧情ID3090204","TextValue"=>"Ich weiß! Ich weiß! Wir haben ein paar Signalballons, die in den Himmel schweben können!"],
13990=>["Value"=>13990,"TextKey"=>"剧情ID3090205","TextValue"=>"Das ist eine wunderbare Idee! Wir brauchen nur noch ein paar kleine Änderungen, um sie aufzupeppen. "],
13991=>["Value"=>13991,"TextKey"=>"剧情ID3090206","TextValue"=>"Habt ihr noch diese leuchtenden gelben und pinken Felsen übrig?"],
13992=>["Value"=>13992,"TextKey"=>"剧情ID3090207","TextValue"=>"Ja, haben wir!"],
13993=>["Value"=>13993,"TextKey"=>"剧情ID3090208","TextValue"=>"Erstaunlich. Gib mir einen Moment. Kevin, komm."],
13994=>["Value"=>13994,"TextKey"=>"剧情ID3090301","TextValue"=>"Uff, das war eine ganz schöne Übung. Aber sieh sie dir an, sind sie nicht einfach wunderschön?"],
13995=>["Value"=>13995,"TextKey"=>"剧情ID3090302","TextValue"=>"Ja, das sind sie wirklich."],
13996=>["Value"=>13996,"TextKey"=>"剧情ID3090303","TextValue"=>"Freut mich, dass sie dir gefallen. Es ist selten, dass Mama etwas Normales macht. Wie auch immer, es ist schon spät, ich werde jetzt zurückgehen. "],
13997=>["Value"=>13997,"TextKey"=>"剧情ID3090304","TextValue"=>"Du gehst schon?"],
13998=>["Value"=>13998,"TextKey"=>"剧情ID3090305","TextValue"=>"Ja, natürlich! Ich werde nicht mit euch stinkenden Männern in eurem winzigen Zelt kuscheln! Mama, kommst du mit mir?"],
13999=>["Value"=>13999,"TextKey"=>"剧情ID3090306","TextValue"=>"Ich komme später nach. Deine neuen Freunde scheinen reizend zu sein, besonders dieser süße kleine Priester! Ich möchte einen Moment mit ihnen verbringen."],
14000=>["Value"=>14000,"TextKey"=>"剧情ID3090307","TextValue"=>"Mama, beherrsche dich!"],
14001=>["Value"=>14001,"TextKey"=>"剧情ID3090308","TextValue"=>"Ich weiß, ich weiß, ich habe mich jetzt gut unter Kontrolle. Immerhin haben wir noch eine lange gemeinsame Reise vor uns."],
14002=>["Value"=>14002,"TextKey"=>"剧情ID3090309","TextValue"=>"Na dann. Man sieht sich."],
14003=>["Value"=>14003,"TextKey"=>"剧情ID3090401","TextValue"=>"Wolltest du gerade andeuten, dass du dich uns anschließen wirst?"],
14004=>["Value"=>14004,"TextKey"=>"剧情ID3090402","TextValue"=>"Natürlich, warum nicht! Dein Abenteuer wird immer gefährlicher werden. "],
14005=>["Value"=>14005,"TextKey"=>"剧情ID3090403","TextValue"=>"Es gibt nicht viel, was ich tun kann, aber zumindest kann ich etwas Licht in das bringen, was noch kommen wird."],
14006=>["Value"=>14006,"TextKey"=>"剧情ID3090404","TextValue"=>"Aber ich brauche dich, um mir den Weg zu deiner Heimat zu zeigen. Mein Orientierungssinn ist... unvorstellbar schrecklich."],
14007=>["Value"=>14007,"TextKey"=>"剧情ID4010101","TextValue"=>"Autsch...Warum gibt es so einen Ort auf der Erde?! Meine Füße fühlen sich an, als würden sie ununterbrochen auf Flammen treten..."],
14008=>["Value"=>14008,"TextKey"=>"剧情ID4010102","TextValue"=>"Beeindruckend, Enda! Seufz... Du hast seit vier Stunden nicht mehr als fünf Worte gesprochen."],
14009=>["Value"=>14009,"TextKey"=>"剧情ID4010103","TextValue"=>"Ich bin... zu müde... zu heiß..."],
14010=>["Value"=>14010,"TextKey"=>"剧情ID4010104","TextValue"=>"Ihr seid ein Haufen zerbrechlicher Babypuppen! Es ist nur ein Vulkan. Schaut euch eure Körperhaltung an, als würdet ihr euch auf den Boden legen!"],
14011=>["Value"=>14011,"TextKey"=>"剧情ID4010105","TextValue"=>"Madame... Sie haben auch geschwitzt wie ein Wasserfall. Geht es dir nicht gut?"],
14012=>["Value"=>14012,"TextKey"=>"剧情ID4010106","TextValue"=>"Nennt mich Tlachtga!... Ich bin nicht müde, aber es ist in der Tat sehr heiß hier... was viel gefährlicher ist als auf See."],
14013=>["Value"=>14013,"TextKey"=>"剧情ID4010107","TextValue"=>"Es scheint, dass wir angekommen sind."],
14014=>["Value"=>14014,"TextKey"=>"剧情ID4010108","TextValue"=>"Lass mich sehen! Laut den Anweisungen der Göttin gibt es ein flammendes Meer mit Inseln darin..."],
14015=>["Value"=>14015,"TextKey"=>"剧情ID4010109","TextValue"=>"Ja, es muss hier sein!"],
14016=>["Value"=>14016,"TextKey"=>"剧情ID4010110","TextValue"=>"Aber wo ist Amergin? Amergin sollte hier angekommen sein und auf uns warten. Aber er ist nirgends zu sehen"],
14017=>["Value"=>14017,"TextKey"=>"剧情ID4010111","TextValue"=>"Ich sollte einen Altar bauen, um Amergins Spuren zu spüren. Aber..."],
14018=>["Value"=>14018,"TextKey"=>"剧情ID4010201","TextValue"=>"Au... Häuptling, ich..."],
14019=>["Value"=>14019,"TextKey"=>"剧情ID4010202","TextValue"=>"Enda!"],
14020=>["Value"=>14020,"TextKey"=>"剧情ID4010203","TextValue"=>"Enda!"],
14021=>["Value"=>14021,"TextKey"=>"剧情ID4010204","TextValue"=>"Sie muss einen Hitzschlag haben! Beeilt euch! Baut einen Schatten für sie, damit sie sich ausruhen kann!"],
14022=>["Value"=>14022,"TextKey"=>"剧情ID4020101","TextValue"=>"Sir, der Bau ist abgeschlossen!"],
14023=>["Value"=>14023,"TextKey"=>"剧情ID4020102","TextValue"=>"Göttin, ich scheine ein wenig länger leben zu können..."],
14024=>["Value"=>14024,"TextKey"=>"剧情ID4020103","TextValue"=>"Es ist wirklich zu heiß! Ich vermisse den Geruch des Meeres so sehr..."],
14025=>["Value"=>14025,"TextKey"=>"剧情ID4020104","TextValue"=>"Puh, unser Priester sieht viel besser aus."],
14026=>["Value"=>14026,"TextKey"=>"剧情ID4020105","TextValue"=>"Es ist ein bisschen besser, ein Zelt zu haben, das uns vor der erdrückenden heißen Luft schützt..."],
14027=>["Value"=>14027,"TextKey"=>"剧情ID4020106","TextValue"=>"Aber nur ein kleines bisschen."],
14028=>["Value"=>14028,"TextKey"=>"剧情ID4020107","TextValue"=>"Deine heilige Göttin! Bitte dreh mich um, damit ich gleichmäßig gegrillt werden kann..."],
14029=>["Value"=>14029,"TextKey"=>"剧情ID4020108","TextValue"=>"Ich muss sagen, dass es sich hier wirklich wie ein großer Ofen anfühlt."],
14030=>["Value"=>14030,"TextKey"=>"剧情ID4020109","TextValue"=>"Seht! Das Tiefland dort drüben!"],
14031=>["Value"=>14031,"TextKey"=>"剧情ID4020110","TextValue"=>"Seht her, Leute! Meine Mutter hat buchstäblich ein Genie geboren."],
14032=>["Value"=>14032,"TextKey"=>"剧情ID4030101","TextValue"=>"Fantastisch, Tlachtga! Das ist Wasser! WASSER!!"],
14033=>["Value"=>14033,"TextKey"=>"剧情ID4030102","TextValue"=>"Hah, ich dachte, unser frommer Priester hätte die Göttin gesehen."],
14034=>["Value"=>14034,"TextKey"=>"剧情ID4030103","TextValue"=>"Ich bin wieder ins Leben zurückgekehrt, und es geht mir ziemlich gut!"],
14035=>["Value"=>14035,"TextKey"=>"剧情ID4030104","TextValue"=>"Ich kann sehen, dass ihr tatsächlich mehr Energie habt!"],
14036=>["Value"=>14036,"TextKey"=>"剧情ID4030105","TextValue"=>"In diesem Fall... Du, du und du, beeile dich und baue einen Trainingsring!"],
14037=>["Value"=>14037,"TextKey"=>"剧情ID4030106","TextValue"=>"Trainingsring?"],
14038=>["Value"=>14038,"TextKey"=>"剧情ID4030107","TextValue"=>"Ja, richtig!"],
14039=>["Value"=>14039,"TextKey"=>"剧情ID4030108","TextValue"=>"Sollten wir nicht nach Amergin suchen?"],
14040=>["Value"=>14040,"TextKey"=>"剧情ID4030109","TextValue"=>"Amergin... dieser alte Mann. Ich weiß, dass er die Kräfte der Natur wie ein Kinderspiel kontrollieren kann."],
14041=>["Value"=>14041,"TextKey"=>"剧情ID4030110","TextValue"=>"Bei euch hat der Weg hierher buchstäblich die Hälfte eures Lebens gekostet. Wie können wir das körperliche Training hinter uns lassen?"],
14042=>["Value"=>14042,"TextKey"=>"剧情ID4030111","TextValue"=>"Nun, Enda braucht wirklich mehr Bewegung."],
14043=>["Value"=>14043,"TextKey"=>"剧情ID4030112","TextValue"=>"Halt die Klappe!"],
14044=>["Value"=>14044,"TextKey"=>"剧情ID4030113","TextValue"=>"Nach der Prophezeiung meiner Mutter werden nur noch stärkere Stürme auf uns warten..."],
14045=>["Value"=>14045,"TextKey"=>"剧情ID4030114","TextValue"=>"Mug Ruiths Prophezeiung..."],
14046=>["Value"=>14046,"TextKey"=>"剧情ID4030115","TextValue"=>"Junge Männer!"],
14047=>["Value"=>14047,"TextKey"=>"剧情ID4030116","TextValue"=>"Verstanden!"],
14048=>["Value"=>14048,"TextKey"=>"剧情ID4040101","TextValue"=>"Sieh dir das Hochland im Norden an! Dort gibt es tatsächlich eine natürliche Leiter."],
14049=>["Value"=>14049,"TextKey"=>"剧情ID4040102","TextValue"=>"Ja, Sir!"],
14050=>["Value"=>14050,"TextKey"=>"剧情ID4040103","TextValue"=>"Ist dir die Säule in der Mitte aufgefallen? Das kann nicht natürlich sein. "],
14051=>["Value"=>14051,"TextKey"=>"剧情ID4040104","TextValue"=>"Mit solch einer Höhe und Form... Ich wette auf den Ruf meiner Priesterfamilie, dass es ein Altar aus alten Zeiten sein muss!"],
14052=>["Value"=>14052,"TextKey"=>"剧情ID4040105","TextValue"=>"Dieser Altar sieht verwahrlost aus."],
14053=>["Value"=>14053,"TextKey"=>"剧情ID4040106","TextValue"=>"Richtig, es muss sehr alt sein."],
14054=>["Value"=>14054,"TextKey"=>"剧情ID4040107","TextValue"=>"Ein solcher Altar, der nicht in der Lage ist, mit der Macht des Erzdruiden in Resonanz zu treten, kann uns nicht helfen, Amergin zu finden."],
14055=>["Value"=>14055,"TextKey"=>"剧情ID4040108","TextValue"=>"Häuptling, wir brauchen ein Gerät, das Energie kondensieren kann..."],
14056=>["Value"=>14056,"TextKey"=>"剧情ID4040109","TextValue"=>"Die Materialien müssen den hohen Temperaturen standhalten, und die Form muss nach innen gerichtet sein."],
14057=>["Value"=>14057,"TextKey"=>"剧情ID4040110","TextValue"=>"Was ist mit den seltsamen Reißzähnen in der Nähe der Lava?"],
14058=>["Value"=>14058,"TextKey"=>"剧情ID4040111","TextValue"=>"Nicht schlecht, Arlan! Kein Wunder, dass die Aufforderung der Göttin zum Abschied lautete: "Bleib immer in der Nähe der wichtigen Partner"!"],
14059=>["Value"=>14059,"TextKey"=>"剧情ID4040112","TextValue"=>"Gewiss! Der Göttin sei Dank!"],
14060=>["Value"=>14060,"TextKey"=>"剧情ID4040113","TextValue"=>"Halt die Klappe! Du bist nicht dabei!"],
14061=>["Value"=>14061,"TextKey"=>"剧情ID4040114","TextValue"=>"Überlassen wir alle Materialien unserem wunderbaren Häuptling!"],
14062=>["Value"=>14062,"TextKey"=>"剧情ID4050101","TextValue"=>"Häuptling, wir machen so viele Fortschritte."],
14063=>["Value"=>14063,"TextKey"=>"剧情ID4050102","TextValue"=>"Der Altar sollte gut zu benutzen sein!"],
14064=>["Value"=>14064,"TextKey"=>"剧情ID4050103","TextValue"=>"Aber sieh dir den düsteren Himmel an! Enda hat Mühe, die Altartreppe hoch und runter zu gehen. Was, wenn sie stürzt?"],
14065=>["Value"=>14065,"TextKey"=>"剧情ID4050104","TextValue"=>"Nicht schlecht, etwas...stan. Es stellt sich heraus, dass du manchmal gar nicht so nervig bist."],
14066=>["Value"=>14066,"TextKey"=>"剧情ID4050105","TextValue"=>"Schließlich ist Enda alt... ähm... ich meine nicht mehr jung."],
14067=>["Value"=>14067,"TextKey"=>"剧情ID4050106","TextValue"=>"Was hast du davon, mich zu verärgern?"],
14068=>["Value"=>14068,"TextKey"=>"剧情ID4050107","TextValue"=>"Lasst uns Fackeln auf beiden Seiten der Treppe bauen. Das ist ganz einfach!"],
14069=>["Value"=>14069,"TextKey"=>"剧情ID4060101","TextValue"=>"Lasst uns Fackeln auf beiden Seiten der Treppe bauen. Das ist ganz einfach!"],
14070=>["Value"=>14070,"TextKey"=>"剧情ID4060102","TextValue"=>"Aber es sollte reichen, um Amergin zu spüren!"],
14071=>["Value"=>14071,"TextKey"=>"剧情ID4060103","TextValue"=>"Es ist kalt...argh...Wer ist da?"],
14072=>["Value"=>14072,"TextKey"=>"剧情ID4060104","TextValue"=>"Amergin! Wo bist du?"],
14073=>["Value"=>14073,"TextKey"=>"剧情ID4060105","TextValue"=>"Bist... bist du Enda? Ich weiß nicht, wo ich bin. Aber es ist so kalt hier..."],
14074=>["Value"=>14074,"TextKey"=>"剧情ID4060106","TextValue"=>"Kalt?"],
14075=>["Value"=>14075,"TextKey"=>"剧情ID4060107","TextValue"=>"Es scheint, dass er nicht hier ist."],
14076=>["Value"=>14076,"TextKey"=>"剧情ID4060108","TextValue"=>"Ich kann mich nicht bewegen... Hilfe, $#^*,!@%&:?""],
14077=>["Value"=>14077,"TextKey"=>"剧情ID4060109","TextValue"=>"Was hast du gesagt?"],
14078=>["Value"=>14078,"TextKey"=>"剧情ID4060110","TextValue"=>"Hey, Enda. Ich glaube..."],
14079=>["Value"=>14079,"TextKey"=>"剧情ID4060111","TextValue"=>"L"&%*@#$"…"],
14080=>["Value"=>14080,"TextKey"=>"剧情ID4060112","TextValue"=>"Amergin! Halte durch! Ich muss jetzt mit einer anderen Person sprechen, das könnte dir helfen."],
14081=>["Value"=>14081,"TextKey"=>"剧情ID4060113","TextValue"=>"Tlachtga, hast du diese Situation schon einmal erlebt?"],
14082=>["Value"=>14082,"TextKey"=>"剧情ID4060114","TextValue"=>"Hey…"],
14083=>["Value"=>14083,"TextKey"=>"剧情ID4060115","TextValue"=>"Spirituelle Kommunikation ist nicht wirklich mein Fachgebiet. Aber meine Mutter ist mit der gleichen Situation konfrontiert worden. Das Problem dürfte immer noch der Altar sein."],
14084=>["Value"=>14084,"TextKey"=>"剧情ID4060116","TextValue"=>"Die Kraft des Altars ist noch zu schwach. Es fehlt das Wichtigste."],
14085=>["Value"=>14085,"TextKey"=>"剧情ID4060117","TextValue"=>"Die Macht der Göttin... @#$>:%^Essenz"],
14086=>["Value"=>14086,"TextKey"=>"剧情ID4060118","TextValue"=>"Häuptling, ich glaube, ich habe es. Sieh dir die freie Stelle oben auf der Säule des Altars an!"],
14087=>["Value"=>14087,"TextKey"=>"剧情ID4060119","TextValue"=>"Wir müssen die Geistessenz auffüllen und die Kraft des Altars verstärken. Haben wir sie?"],
14088=>["Value"=>14088,"TextKey"=>"剧情ID4060120","TextValue"=>"Was sagst du dazu? Arlan, ich gebe es dir gleich."],
14089=>["Value"=>14089,"TextKey"=>"剧情ID4060121","TextValue"=>"Ich mach das schon!"],
14090=>["Value"=>14090,"TextKey"=>"剧情ID4070101","TextValue"=>"Amergin, sag etwas!"],
14091=>["Value"=>14091,"TextKey"=>"剧情ID4070102","TextValue"=>"Du musst kommen und mich finden..."],
14092=>["Value"=>14092,"TextKey"=>"剧情ID4070103","TextValue"=>"Diesmal sollte es klappen. Deine Stimme klingt endlich nicht mehr so zweideutig wie die von der hustenden Meg."],
14093=>["Value"=>14093,"TextKey"=>"剧情ID4070104","TextValue"=>"Meg ist nur eine alte Dame."],
14094=>["Value"=>14094,"TextKey"=>"剧情ID4070105","TextValue"=>"Wie du schon sagst..."],
14095=>["Value"=>14095,"TextKey"=>"剧情ID4070106","TextValue"=>"Ich hatte es einmal bis zum Vulkan geschafft, aber ich hatte keine Ahnung, was danach geschah. Als ich aufwachte, war ich bereits hier gelandet, was auch immer dieses Höllenloch ist."],
14096=>["Value"=>14096,"TextKey"=>"剧情ID4070107","TextValue"=>"Obwohl dein Altar mich erreichen kann, kann er dich wohl nicht zu mir führen..."],
14097=>["Value"=>14097,"TextKey"=>"剧情ID4070108","TextValue"=>"Denn obwohl ich Enda spüren und auf ihn reagieren kann, wird dieser Ort... definitiv nicht das können, und es wird es schaffen, sich zu verstecken."],
14098=>["Value"=>14098,"TextKey"=>"剧情ID4070109","TextValue"=>"Irgendwelche Ideen?"],
14099=>["Value"=>14099,"TextKey"=>"剧情ID4070110","TextValue"=>"Koexistiere mit der Umwelt...endlos...und bilde einen Kreislauf."],
14100=>["Value"=>14100,"TextKey"=>"剧情ID4070111","TextValue"=>"Wie meinst du das? Die Flammen hier sollen in den Eiskeller fließen, in dem ihr euch befindet?"],
14101=>["Value"=>14101,"TextKey"=>"剧情ID4070112","TextValue"=>"Du dickköpfiger Student! Nein, natürlich nicht."],
14102=>["Value"=>14102,"TextKey"=>"剧情ID4070113","TextValue"=>"Kreislauf... Lasst die Lava fließen, um Asche zu erzeugen, lasst die Asche aufsteigen und zu Felsen erstarren, und lasst schließlich die Felsen wieder zu Lava ausbrechen."],
14103=>["Value"=>14103,"TextKey"=>"剧情ID4070114","TextValue"=>"Du bist in der Tat ein Spitzenstudent."],
14104=>["Value"=>14104,"TextKey"=>"剧情ID4070115","TextValue"=>"Warte!"],
14105=>["Value"=>14105,"TextKey"=>"剧情ID4080101","TextValue"=>"Ist das... ein Schweinekopf?"],
14106=>["Value"=>14106,"TextKey"=>"剧情ID4080102","TextValue"=>"Uh-huh."],
14107=>["Value"=>14107,"TextKey"=>"剧情ID4080103","TextValue"=>"Bei allem Respekt, warum hat es die Form eines Schweinekopfes?"],
14108=>["Value"=>14108,"TextKey"=>"剧情ID4080104","TextValue"=>"Moment, ich sollte diese Frage nicht stellen."],
14109=>["Value"=>14109,"TextKey"=>"剧情ID4080105","TextValue"=>"Göttin! Liebste Partner werden auf dem Weg zum Erfolg gebraucht. Warum lassen wir nicht meine Partnerin, die Figur des Etwas-Stans hier!"],
14110=>["Value"=>14110,"TextKey"=>"剧情ID4080106","TextValue"=>"Schau mal, wie süß unser Priester ist! Was für eine subtile Art, nett zu sein. "],
14111=>["Value"=>14111,"TextKey"=>"剧情ID4080107","TextValue"=>"Du!"],
14112=>["Value"=>14112,"TextKey"=>"剧情ID4080108","TextValue"=>"Geh aus dem Weg, der Häuptling und ich sind dabei, den Altar zu errichten."],
14113=>["Value"=>14113,"TextKey"=>"剧情ID4090101","TextValue"=>"Seufz... Enda, Showtime."],
14114=>["Value"=>14114,"TextKey"=>"剧情ID4090102","TextValue"=>"Amergin ist in…"],
14115=>["Value"=>14115,"TextKey"=>"剧情ID4090103","TextValue"=>"Der Ferne Osten... Ein Ort, an dem es frostig und verboten ist."],
14116=>["Value"=>14116,"TextKey"=>"剧情ID4090104","TextValue"=>"Obwohl es hier brütend heiß ist, denke ich, wir sollten anfangen, Winterkleidung vorzubereiten."],
14117=>["Value"=>14117,"TextKey"=>"剧情ID99990101","TextValue"=>"That fog looks more suspicious than any crisis I have resolved since the establishment of the Royal Kingdom ever."],
14118=>["Value"=>14118,"TextKey"=>"剧情ID99990102","TextValue"=>"And it seems we are kind of stuck here. Hmmm, anybody here?"],
14119=>["Value"=>14119,"TextKey"=>"剧情ID99990103","TextValue"=>"Not a soul? Guess we have to figure out how to clear the fog all by ourselves."],
14120=>["Value"=>14120,"TextKey"=>"剧情ID47990201","TextValue"=>"Hey! Well done! The wheat appeared for a reason! "],
14121=>["Value"=>14121,"TextKey"=>"剧情ID99990202","TextValue"=>"Let's harvest some first and then see what can we do with them!"],
14122=>["Value"=>14122,"TextKey"=>"剧情ID99990301","TextValue"=>"Oh! A little spellbook! It appeared all of a sudden after I had the bread."],
14123=>["Value"=>14123,"TextKey"=>"剧情ID99990302","TextValue"=>"The fog seems thinned a bit because of the spellbook… Maybe we can use the spellbook to clear the fog away."],
14124=>["Value"=>14124,"TextKey"=>"剧情ID34990101","TextValue"=>"Great! Now let's make a plan: merge ingredients, cook foods, get spellbooks, and last but most importantly -- clear fog!"],
14125=>["Value"=>14125,"TextKey"=>"剧情ID99990601","TextValue"=>"Ha! What's that? Looks like there is a chest buried under those broken stones."],
14126=>["Value"=>14126,"TextKey"=>"剧情ID99990602","TextValue"=>"Let's open it at once and see what's inside! I can't wait to tell my friends about all this!"],
14127=>["Value"=>14127,"TextKey"=>"剧情ID99990701","TextValue"=>"It seems we have to stay here for a little while. We should make use of these stones and build a shelter."],
14128=>["Value"=>14128,"TextKey"=>"剧情ID99990702","TextValue"=>"We did it! Indeed, whatever magic in that spellbook certainly worked!"],
14129=>["Value"=>14129,"TextKey"=>"剧情ID99991001","TextValue"=>"I'm curious about what's gonna happen if we merge 5 items of the same kind at once."],
14130=>["Value"=>14130,"TextKey"=>"剧情ID99991002","TextValue"=>"I think we should give it a go. It seems like something wonderful might follow…"],
14131=>["Value"=>14131,"TextKey"=>"剧情ID99990801","TextValue"=>"What's this?"],
14132=>["Value"=>14132,"TextKey"=>"剧情ID99990802","TextValue"=>"It looks like nothing but ruins. But in a very short time, I promise my brother and I can build a perfect base for a stone castle! "],
14133=>["Value"=>14133,"TextKey"=>"剧情ID99990803","TextValue"=>"Right on! The most urgent affair should be constructing a solid castle to shield us against unknown challenges."],
14134=>["Value"=>14134,"TextKey"=>"剧情ID99990501","TextValue"=>"This hat is beaming faint magic."],
14135=>["Value"=>14135,"TextKey"=>"剧情ID99990502","TextValue"=>"Keep merging! I think this might be a clue that leads us to the right man to help us!"],
14136=>["Value"=>14136,"TextKey"=>"剧情ID99990901","TextValue"=>"What is this magical base with four slots on top? Looks like we need something to activate it!"],
14137=>["Value"=>14137,"TextKey"=>"剧情ID99990902","TextValue"=>"Your Majesty, this is a base for a castle. As long as we build the corresponding houses and place them on top of it, we can easily construct our Royal Castle."],
14138=>["Value"=>14138,"TextKey"=>"剧情ID99990903","TextValue"=>"We will remind you to place those houses on top after we finished construction."],
14139=>["Value"=>14139,"TextKey"=>"剧情ID99991101","TextValue"=>"I can't wait to find out what kind of mysterious treasure is hidden inside."],
14140=>["Value"=>14140,"TextKey"=>"剧情ID99991102","TextValue"=>"We can use it to to merge with stone  resources. Then we can have unlimited stones!"],
14141=>["Value"=>14141,"TextKey"=>"剧情ID99991201","TextValue"=>"Very helpful magic crystal! It can be played as anything you want!"],
14142=>["Value"=>14142,"TextKey"=>"剧情ID99991202","TextValue"=>"With it, you only need 2, not 3, of the same item to merge! Try using it!"],
14143=>["Value"=>14143,"TextKey"=>"剧情ID99991203","TextValue"=>"Remember the Magic Crystal can substitute any item you need in game!"],
14144=>["Value"=>14144,"TextKey"=>"剧情ID30400301","TextValue"=>"Look at this little cute stone frame!"],
14145=>["Value"=>14145,"TextKey"=>"剧情ID30400302","TextValue"=>"Compared to my finest architecture, this is far from close. Come on, Watt! We need more stone bricks!"],
14146=>["Value"=>14146,"TextKey"=>"剧情ID30400401","TextValue"=>"Not bad! You built a door with stones."],
14147=>["Value"=>14147,"TextKey"=>"剧情ID30400402","TextValue"=>"Thanks for your kind words. Please give us more time, we can surely build something better!"],
14148=>["Value"=>14148,"TextKey"=>"剧情ID30400501","TextValue"=>"You guys are indeed excellent stonecutter!"],
14149=>["Value"=>14149,"TextKey"=>"剧情ID30400601","TextValue"=>"Wally and I have constructed a much bigger stone house. I have to say that the arduous efforts we had made totally paid back."],
14150=>["Value"=>14150,"TextKey"=>"剧情ID30400602","TextValue"=>"You sure did! Now, I need a high tower to watch the remote lands."],
14151=>["Value"=>14151,"TextKey"=>"剧情ID30400701","TextValue"=>"With only four more houses like this, I can finally have a Castle on this land."],
14152=>["Value"=>14152,"TextKey"=>"剧情ID30400801","TextValue"=>"Castle completed! We can see it as a treasure box!"],
14153=>["Value"=>14153,"TextKey"=>"剧情ID30400802","TextValue"=>"That's right! There are so many goodies inside the Castle."],
14154=>["Value"=>14154,"TextKey"=>"剧情ID31610301","TextValue"=>"The power of the magic hat is greatly boosted! We should find its master for they must a mighty warlock!"],
14155=>["Value"=>14155,"TextKey"=>"剧情ID31610401","TextValue"=>"Humpf! A rabbit!"],
14156=>["Value"=>14156,"TextKey"=>"剧情ID31610402","TextValue"=>"Haha. Yup! If you have fresh and juicy carrots, don't forget my name… Oh, that will be Morris."],
14157=>["Value"=>14157,"TextKey"=>"剧情ID31610403","TextValue"=>"Morris, then you are destined to join my army! Speaking of the knowledge of delicacies, I'm second to none in the whole Hill Kingdom."],
14158=>["Value"=>14158,"TextKey"=>"剧情ID30410301","TextValue"=>"There are logs. We can build a much more comfortable house."],
14159=>["Value"=>14159,"TextKey"=>"剧情ID30410302","TextValue"=>"Cool. Take it slow this time. There is still time till the cold season creeps."],
14160=>["Value"=>14160,"TextKey"=>"剧情ID30410401","TextValue"=>"A decent ceiling at last."],
14161=>["Value"=>14161,"TextKey"=>"剧情ID30410402","TextValue"=>"Keep going! My fireplace is missing a chimney."],
14162=>["Value"=>14162,"TextKey"=>"剧情ID30410501","TextValue"=>"Why don't we build a lovely attic to reserve all my yummy carrots? They are the best foods in winter."],
14163=>["Value"=>14163,"TextKey"=>"剧情ID30410502","TextValue"=>"Haha, aren't carrots the best foods in all four seasons to you, Morris?"],
14164=>["Value"=>14164,"TextKey"=>"剧情ID30410601","TextValue"=>"I think I can use some more space to equip my little magic widgets."],
14165=>["Value"=>14165,"TextKey"=>"剧情ID30410602","TextValue"=>"The frame structure I designed is perfect for a bigger house."],
14166=>["Value"=>14166,"TextKey"=>"剧情ID30410701","TextValue"=>"What a beautiful house! Watt and Wally, I didn't expect your woodwork skills to be equally excellent!"],
14167=>["Value"=>14167,"TextKey"=>"剧情ID30410801","TextValue"=>"I can't believe one can actually build an outstanding architecture with zero magic spell cast."],
14168=>["Value"=>14168,"TextKey"=>"剧情ID30410802","TextValue"=>"My brother is an expert in architecture design. As for me… I'm good at being a cheerleader."],
14169=>["Value"=>14169,"TextKey"=>"剧情ID30410803","TextValue"=>"Watt, we need to catch up!"],
14170=>["Value"=>14170,"TextKey"=>"剧情ID30410901","TextValue"=>"Behold! A warm and cozy castle is ready!"],
14171=>["Value"=>14171,"TextKey"=>"剧情ID30410902","TextValue"=>"Nice! It is warm in winter and cool in summer! I suggest you prepare some hot biscuits for afternoon tea in winter times."],
14172=>["Value"=>14172,"TextKey"=>"剧情ID30410903","TextValue"=>"Or some carrot cakes and loaves of bread."],
14173=>["Value"=>14173,"TextKey"=>"剧情ID31620301","TextValue"=>"Morris, who would need these many harps?"],
14174=>["Value"=>14174,"TextKey"=>"剧情ID31620302","TextValue"=>"Ummm, I can't think of anyone. But this person must be a musician!"],
14175=>["Value"=>14175,"TextKey"=>"剧情ID31620401","TextValue"=>"I feel the power within these harps continues to grow."],
14176=>["Value"=>14176,"TextKey"=>"剧情ID31620501","TextValue"=>"These harps can be the best sword for a musician. So, can it keep leveling up?"],
14177=>["Value"=>14177,"TextKey"=>"剧情ID31620601","TextValue"=>"I can almost see the grandness of this harp being played in a luxurious music hall of the House of Hill."],
14178=>["Value"=>14178,"TextKey"=>"剧情ID31620602","TextValue"=>"I believe the owner of this harp will be given such a chance."],
14179=>["Value"=>14179,"TextKey"=>"剧情ID31620701","TextValue"=>"I'm Ramble, your humble servant. I have one more thing to celebrate in songs!"],
14180=>["Value"=>14180,"TextKey"=>"剧情ID31620702","TextValue"=>"Umm, can someone please make me an Icecream Muffin? I'm sure your beautiful music will be a perfect combo to it, which is even better than cinnamon powder!"],
14181=>["Value"=>14181,"TextKey"=>"剧情ID31620703","TextValue"=>"*In the arc music hall, in the breezy spring fields, in the presence of the one, whom the hymn gives*"],
14182=>["Value"=>14182,"TextKey"=>"剧情ID30420401","TextValue"=>"I quite like this exquisite door. Well, perhaps a wind vane will be needed over the sea?"],
14183=>["Value"=>14183,"TextKey"=>"剧情ID30420501","TextValue"=>"Ohh, it so reminds me of those old adventure days. Listen, we need to increase the height of the base. Y'all know waves crashing is no kidding."],
14184=>["Value"=>14184,"TextKey"=>"剧情ID30420601","TextValue"=>"Pretty good! Wally, you are no doubt a genius!"],
14185=>["Value"=>14185,"TextKey"=>"剧情ID30420602","TextValue"=>"Haha, Wally never fails you! And... since I've known him for my life, it's far from the time to celebrate."],
14186=>["Value"=>14186,"TextKey"=>"剧情ID30420701","TextValue"=>"Praise be to the brilliant craftsman! And what else do we need… bright lights dancing in the dark night, becoming the only beacon to the travelers."],
14187=>["Value"=>14187,"TextKey"=>"剧情ID30420801","TextValue"=>"What a wonderful boathouse! With only a couple more like this, our cruise ship will be ready to set sail!"],
14188=>["Value"=>14188,"TextKey"=>"剧情ID30420901","TextValue"=>"I can hear the waves beating and I can smell the storm coming! How exciting!"],
14189=>["Value"=>14189,"TextKey"=>"剧情ID30420902","TextValue"=>"Haha, check out Ramble's dreaming about adventures already! Watt and Wally, you two are indeed the best craftsmen ever!"],
14190=>["Value"=>14190,"TextKey"=>"剧情ID30420903","TextValue"=>"Thanks for your appreciation, Your Majesty! This boat castle also means our strength is greatly enhanced! "],
14191=>["Value"=>14191,"TextKey"=>"剧情ID31630301","TextValue"=>"That drum grew taller, looking like it's for an adult now! I want to jam a little bit, lol!"],
14192=>["Value"=>14192,"TextKey"=>"剧情ID31630401","TextValue"=>"In my opinion, a belt is needed for the drum. That'll be protective to the drumhead."],
14193=>["Value"=>14193,"TextKey"=>"剧情ID31630501","TextValue"=>"How about a fixation on the drum frame? Ramble knows musicians like him will get so carried away during the performance. It'll be a shame if it goes broken."],
14194=>["Value"=>14194,"TextKey"=>"剧情ID31630502","TextValue"=>"Correct. I should count how many harps I've played. One, two, three, four…"],
14195=>["Value"=>14195,"TextKey"=>"剧情ID31630601","TextValue"=>"The feather decoration looks very cute and unique. What do you think, Ramble?"],
14196=>["Value"=>14196,"TextKey"=>"剧情ID31630602","TextValue"=>"Yeah… but it might get in the way while playing. It's better to change the décor's location."],
14197=>["Value"=>14197,"TextKey"=>"剧情ID31630701","TextValue"=>"Now, it won't bother beating the drum. "],
14198=>["Value"=>14198,"TextKey"=>"剧情ID31630702","TextValue"=>"But the original simplicity and delicate beauty are weakened. Ramble, do you think you can improve that?"],
14199=>["Value"=>14199,"TextKey"=>"剧情ID31630801","TextValue"=>"Did you guys find my drum? Thanks!"],
14200=>["Value"=>14200,"TextKey"=>"剧情ID31630802","TextValue"=>"What a lovely wee lass!"],
14201=>["Value"=>14201,"TextKey"=>"剧情ID31630803","TextValue"=>"*Giggles* Thank you. I'm Melody, feel free to call me Mel! I have no idea why I woke up here in the fog."],
14202=>["Value"=>14202,"TextKey"=>"剧情ID31630804","TextValue"=>"That happened to everybody. Mel, glad you are joining us in this adventure!"],
14203=>["Value"=>14203,"TextKey"=>"剧情ID30430301","TextValue"=>"Beautiful pearl! I always want one, even though it doesn't have any function."],
14204=>["Value"=>14204,"TextKey"=>"剧情ID30430302","TextValue"=>"I know you'll like it! Well, Mel, we can build a pearl house next."],
14205=>["Value"=>14205,"TextKey"=>"剧情ID30430401","TextValue"=>"Wally is so creative! Pearl rooftop will be beautiful, but wouldn't that be too fragile?"],
14206=>["Value"=>14206,"TextKey"=>"剧情ID30430501","TextValue"=>"Dearest Watt and Wally, can you build it more spacious? More space is needed to stock pearls and shells."],
14207=>["Value"=>14207,"TextKey"=>"剧情ID30430502","TextValue"=>"One sec."],
14208=>["Value"=>14208,"TextKey"=>"剧情ID30430601","TextValue"=>"How about adding some seaweeds as décor?"],
14209=>["Value"=>14209,"TextKey"=>"剧情ID30430701","TextValue"=>"Stunning! Hahaha, I'm so happy. Can't stop smiling whenever I see the pearl house."],
14210=>["Value"=>14210,"TextKey"=>"剧情ID30430702","TextValue"=>"Aww, Mel, wait a sec. I stole — I mean, borrowed the design sketch from Wally."],
14211=>["Value"=>14211,"TextKey"=>"剧情ID30430801","TextValue"=>"Wow! There are two spires! This landscape is so glorious that I haven't seen it even in my most unstrained dream!"],
14212=>["Value"=>14212,"TextKey"=>"剧情ID30430802","TextValue"=>"It only takes four mansions like this to build a top-notch castle."],
14213=>["Value"=>14213,"TextKey"=>"剧情ID30430901","TextValue"=>"What do you think? Not bad, right? I knew Mel would love those spires."],
14214=>["Value"=>14214,"TextKey"=>"剧情ID30430902","TextValue"=>"Can I look around? Alrighty! I'm coming in! Aha, where's my drum? I want to drop some beats."],
14215=>["Value"=>14215,"TextKey"=>"剧情ID30430903","TextValue"=>"Let me be your accompany, Mel."],
14216=>["Value"=>14216,"TextKey"=>"剧情ID31640301","TextValue"=>"This crown should belong to someone important. Your Majesty, does that ring any bells?"],
14217=>["Value"=>14217,"TextKey"=>"剧情ID31640302","TextValue"=>"I'm not sure. It doesn't have the Royal Lable of House Hill. So, I really can't think of anyone who it belongs."],
14218=>["Value"=>14218,"TextKey"=>"剧情ID31640401","TextValue"=>"Magnificent gold, workmanship glowed. Used as a symbol in poems, represent power the most."],
14219=>["Value"=>14219,"TextKey"=>"剧情ID31640501","TextValue"=>"Inlaid with emerald, ha, very much in line with my Queen's aesthetic!"],
14220=>["Value"=>14220,"TextKey"=>"剧情ID31640601","TextValue"=>"What? Morris just told me such a luxurious crown is not even superior!"],
14221=>["Value"=>14221,"TextKey"=>"剧情ID31640602","TextValue"=>"Yup. I can feel the magic power hidden in the crown is far from the upper limit."],
14222=>["Value"=>14222,"TextKey"=>"剧情ID31640701","TextValue"=>"When the crown's owner came, I wonder if I could borrow to try it on? It is sooooo pretty!"],
14223=>["Value"=>14223,"TextKey"=>"剧情ID31640801","TextValue"=>"My! I can feel the magic is vibrating intensely. Its owner will soon arrive!"],
14224=>["Value"=>14224,"TextKey"=>"剧情ID31640901","TextValue"=>"Oh my goodness! Hill, my old pal!"],
14225=>["Value"=>14225,"TextKey"=>"剧情ID31640902","TextValue"=>"No way! I can't believe you are stuck here too! Oi oi, everyone! Let me introduce the King of Lion, Simba."],
14226=>["Value"=>14226,"TextKey"=>"剧情ID31640903","TextValue"=>"I have made a preliminary judgment about the surroundings here. There's no time to delay. Keep constructing and expanding territory."],
14227=>["Value"=>14227,"TextKey"=>"剧情ID30440301","TextValue"=>"This shabby wagon can barely shelter me from the wind and rain."],
14228=>["Value"=>14228,"TextKey"=>"剧情ID30440302","TextValue"=>"Lion King, you are right. We still need more time."],
14229=>["Value"=>14229,"TextKey"=>"剧情ID30440401","TextValue"=>"It is basic. However, that's a great model for further processing."],
14230=>["Value"=>14230,"TextKey"=>"剧情ID30440402","TextValue"=>"Improve the driver's seat. The long journey shall not be easy."],
14231=>["Value"=>14231,"TextKey"=>"剧情ID30440501","TextValue"=>"Nice! Guest seats also need to be improved. Watt and Wally, can you two please do us one more favor?"],
14232=>["Value"=>14232,"TextKey"=>"剧情ID30440601","TextValue"=>"Woohoo! Comfort level considerably increased. Well, I say we build it more confined. Privacy is no lesser than safety. Simba, I only suggested it because of our cooperation last time."],
14233=>["Value"=>14233,"TextKey"=>"剧情ID30440701","TextValue"=>"Indeed excellent! I've heard about your craftmanship, Watt and Wally. Too bad my lions only have fluffy paws, and this kind of delicate work is no match for lions."],
14234=>["Value"=>14234,"TextKey"=>"剧情ID30440702","TextValue"=>"Lol! Thanks for your appreciation, Lion King! There's still room for improvement. Wait and see what happens!"],
14235=>["Value"=>14235,"TextKey"=>"剧情ID30440801","TextValue"=>"Wally, can you add another story to it? The magic circulation requires height."],
14236=>["Value"=>14236,"TextKey"=>"剧情ID30440802","TextValue"=>"Gotcha! High-ceiling design is my expertise."],
14237=>["Value"=>14237,"TextKey"=>"剧情ID30440901","TextValue"=>"Watt and Wally, do you want to follow me to my Kingdom after all this? I guarantee that you will be treated even better than in Kingdom Hill."],
14238=>["Value"=>14238,"TextKey"=>"剧情ID30440902","TextValue"=>"Simba, I'm right here! I thought you would at least avoid me while poaching my staff!"],
14239=>["Value"=>14239,"TextKey"=>"剧情ID30441001","TextValue"=>"This castle means a lot to me. It allows me to live the spontaneous life I love and takes me to wherever I want."],
14240=>["Value"=>14240,"TextKey"=>"剧情ID30441002","TextValue"=>"Simba has been running freely over the fields. No wonder he wants a mobile castle to live in."],
14241=>["Value"=>14241,"TextKey"=>"剧情ID30441003","TextValue"=>"Watt and Wally, please take serious consideration into the advice I gave earlier."],
14242=>["Value"=>14242,"TextKey"=>"剧情ID31650301","TextValue"=>"Wow! It's getting better! But the portion for me is still too small."],
14243=>["Value"=>14243,"TextKey"=>"剧情ID31650401","TextValue"=>"The magic around the foods and the table are filling up. "],
14244=>["Value"=>14244,"TextKey"=>"剧情ID31650501","TextValue"=>"I'm a carnivore. But I know Hill's a sweet tooth. If you stay out of mine, I'll stay out of yours."],
14245=>["Value"=>14245,"TextKey"=>"剧情ID31650601","TextValue"=>"This reminds me of the old times when I host banquets. Though we are a little short of number, we can surely prepare a big meal for dinner tonight!"],
14246=>["Value"=>14246,"TextKey"=>"剧情ID31650701","TextValue"=>"This symbolized a fairy evening."],
14247=>["Value"=>14247,"TextKey"=>"剧情ID31650801","TextValue"=>"The magic is reaching the pinnacle. We can soon meet the owner of these yummy visions. "],
14248=>["Value"=>14248,"TextKey"=>"剧情ID31650901","TextValue"=>"…"],
14249=>["Value"=>14249,"TextKey"=>"剧情ID31650902","TextValue"=>"Hiya, lovely girl! What's your name?"],
14250=>["Value"=>14250,"TextKey"=>"剧情ID31650903","TextValue"=>"I… ummmm... I don't have a name. They call me "Little Match Girl". Perhaps… maybe... you can call me "Match"?"],
14251=>["Value"=>14251,"TextKey"=>"剧情ID31650904","TextValue"=>"Okay. Don't be afraid, kid. Come in and warm yourself up in our castle."],
14252=>["Value"=>14252,"TextKey"=>"剧情ID30450301","TextValue"=>"What's up, Match. Is this matchbox something you are thinking of?"],
14253=>["Value"=>14253,"TextKey"=>"剧情ID30450302","TextValue"=>"Yes, yes! If I curl up, I can squeeze myself in it, protecting myself against the wind."],
14254=>["Value"=>14254,"TextKey"=>"剧情ID30450401","TextValue"=>"Thank you, Watt! I can't imagine I can own a hut with beams one day. So happy!"],
14255=>["Value"=>14255,"TextKey"=>"剧情ID30450501","TextValue"=>"I can actually stand up inside the house. No more curling up. Hooray!"],
14256=>["Value"=>14256,"TextKey"=>"剧情ID30450601","TextValue"=>"Match, I think you'll like this windproof curtain."],
14257=>["Value"=>14257,"TextKey"=>"剧情ID30450602","TextValue"=>"Totally! I can save some matches to warm up now."],
14258=>["Value"=>14258,"TextKey"=>"剧情ID30450701","TextValue"=>"Ta-da~ The high-ceiling design I'm best at!"],
14259=>["Value"=>14259,"TextKey"=>"剧情ID30450702","TextValue"=>"Thank you so much! This is the prettiest house I've ever seen in my life… even better than those rich people's houses on the streets in the past."],
14260=>["Value"=>14260,"TextKey"=>"剧情ID30450801","TextValue"=>"If you can come up with one request for the house, what would it be?"],
14261=>["Value"=>14261,"TextKey"=>"剧情ID30450802","TextValue"=>"Ahhh… Owning a house is already beyond my expectation. I don't have any requests."],
14262=>["Value"=>14262,"TextKey"=>"剧情ID30450803","TextValue"=>"Not with that attitude, Match! C'mon, think harder! What do you really really really want?"],
14263=>["Value"=>14263,"TextKey"=>"剧情ID30450804","TextValue"=>"Umm… I think… that will be warmth. Yeah! I want it to be super warm!"],
14264=>["Value"=>14264,"TextKey"=>"剧情ID30450901","TextValue"=>"As long as we build four mansions like this, Little Match Girl will have her private castle!"],
14265=>["Value"=>14265,"TextKey"=>"剧情ID30451001","TextValue"=>"Are you guys serious? … This beautiful castle… is MINE?"],
14266=>["Value"=>14266,"TextKey"=>"剧情ID30451002","TextValue"=>"Of course, my dear child! This land is full of dangers. That's why we should value our accommodations. "],
14267=>["Value"=>14267,"TextKey"=>"剧情ID30451003","TextValue"=>"Waaah… Thank you! Thank you all!"],
14268=>["Value"=>14268,"TextKey"=>"剧情ID30451004","TextValue"=>"Go take some proper rest and be ready for the upcoming challenges!"],
14269=>["Value"=>14269,"TextKey"=>"剧情ID31660301","TextValue"=>"Fixation was a great idea. However, can we change its frame to a modern design? It looks not so transparent now."],
14270=>["Value"=>14270,"TextKey"=>"剧情ID31660401","TextValue"=>"Who will be the lamp holder?"],
14271=>["Value"=>14271,"TextKey"=>"剧情ID31660501","TextValue"=>"The fire is getting so much more bright! Morris, do you agree?"],
14272=>["Value"=>14272,"TextKey"=>"剧情ID31660502","TextValue"=>"Indeed, Your Majesty. This is a sign of enhanced magic."],
14273=>["Value"=>14273,"TextKey"=>"剧情ID31660601","TextValue"=>"Is this… a pumpkin? *Sweet'o'pumpkin, spooky'o'night* It's a perfect plant for my serenade!"],
14274=>["Value"=>14274,"TextKey"=>"剧情ID31660701","TextValue"=>"A lovely pumpkin lamp. It can be used as a decorative ornament."],
14275=>["Value"=>14275,"TextKey"=>"剧情ID31660702","TextValue"=>"It's hard to tell that the magic power it possessed is quite remarkable."],
14276=>["Value"=>14276,"TextKey"=>"剧情ID31660801","TextValue"=>"Did you guys notice that the impression of the pumpkin lamp just changed! It looks more and more like a human… Spooky..."],
14277=>["Value"=>14277,"TextKey"=>"剧情ID31660802","TextValue"=>"I have a hunch that this pumpkin friend will be meeting us soon."],
14278=>["Value"=>14278,"TextKey"=>"剧情ID31660901","TextValue"=>"Greetings, y'all! Ready for the spooky party at midnight?"],
14279=>["Value"=>14279,"TextKey"=>"剧情ID31660902","TextValue"=>"Pumpkinhead! Don't scare young kids. By the way, is your head ripe and sweet when you pick it?"],
14280=>["Value"=>14280,"TextKey"=>"剧情ID31660903","TextValue"=>"Ummm… actually pumpkins are not edible for they contain a toxic chemical called "pumpkin acid". And don't call me pumpkinhead, my name is Jack!"],
14281=>["Value"=>14281,"TextKey"=>"剧情ID31660904","TextValue"=>"Alright, Jack. That is a lie. Are you afraid I'm going to eat you?"],
14282=>["Value"=>14282,"TextKey"=>"剧情ID31660905","TextValue"=>"… See you, Mr. King!"],
14283=>["Value"=>14283,"TextKey"=>"剧情ID30460301","TextValue"=>"For me, straws are the best protection against cold."],
14284=>["Value"=>14284,"TextKey"=>"剧情ID30460401","TextValue"=>"Help me think… what are the things people might be startled at first glance? Oh right! Skeleton! I want to put a skeleton set on my front gate. "],
14285=>["Value"=>14285,"TextKey"=>"剧情ID30460501","TextValue"=>"Why don't you add something pumpkins to your façade? Just like what I did to mine with carrots."],
14286=>["Value"=>14286,"TextKey"=>"剧情ID30460601","TextValue"=>"Do you want to open a skylight, Mr. Jack? To do that, we have to take off the skeleton décor."],
14287=>["Value"=>14287,"TextKey"=>"剧情ID30460701","TextValue"=>"I really like it! But I feel that pumpkin can be bigger. Can you help me out?"],
14288=>["Value"=>14288,"TextKey"=>"剧情ID30460702","TextValue"=>"Sure thing. You can always trust Watt with carving."],
14289=>["Value"=>14289,"TextKey"=>"剧情ID30460801","TextValue"=>"Wow, soooooo beautiful! Hem hem, no, I mean… I still need a lantern on it! Yup, a lantern!"],
14290=>["Value"=>14290,"TextKey"=>"剧情ID30460901","TextValue"=>"This mansion looks like a large Jack! Hah-hah-hah, a small Jack living in a big Jack!"],
14291=>["Value"=>14291,"TextKey"=>"剧情ID30461001","TextValue"=>"Wow, my pumpkin, my straws, my lantern! Watt and Wally, you two are simply geniuses! I announce that you two are officially on top of my PRANKING LIST!"],
14292=>["Value"=>14292,"TextKey"=>"剧情ID30461002","TextValue"=>"Oh geez, cut me some slacks. But please do not let Watt escape!"],
